INSERT INTO `i2D_D_Category` (`i2D_D_CATEGORY_ID`, `i2D_D_CATEGORY_CODE`, `i2D_D_SUB_CATEGORY_CODE`, `i2D_D_CHILD_CATEGORY_CODE`, `i2D_D_CATEGORY_NAME`, `i2D_D_CATEGORY_DESCIPTION`, `i2D_D_ACTIVE`) VALUES
(8, 'A', '', '', 'Arts, culture & humanities', 'Private nonprofit organizations whose primary purpose is to promote appreciation for and enjoyment and understanding of the visual, performing, folk, and media arts; the humanities (archaeology, art history, modern and classical languages, philosophy, ethics, theology, and comparative religion); history and historical events; and/or communications (film, video, publishing, journalism, radio, television).', 'Yes'),
(12, 'A', '2', '', 'Arts & culture', 'Organizations that promote, produce or provide access to a variety of arts experiences encompassing the visual, media or performing arts.', 'Yes'),
(15, 'A', '2', '5', 'Arts education', 'Organizations that provide informal arts educational programming and/or instruction but do not grant diplomas or degrees; or which offer services regarding the arts to educational institutions or to public entities involved in education.', 'Yes'),
(16, 'A', '2', '6', 'Arts & humanities councils & agencies', 'Organizations that foster, nurture and sustain artistic excellence and create a climate in which the arts and humanities may flourish in a community.', 'Yes'),
(19, 'A', '5', '', 'Museums', 'Organizations that produce films, videos and holographic images for a variety of educational, documentary and cultural purposes, and/or promote public appreciation of film and video. also included are organizations that encourage new, foreign and independent filmmakers through the organization and presentation of film expositions and festivals or which show old or difficult to obtain films in noncommercial facilities.', 'Yes'),
(20, 'A', '5', '1', 'Art museums', 'Organizations engaged in television productions and broadcast. includes producers of public television, cable television, community access television, broadcasting in schools, and interactive television.', 'Yes'),
(21, 'A', '5', '2', 'Childrenâ€™s museums', 'Organizations that publish a variety of materials on diverse topics. includes university presses.', 'Yes'),
(22, 'A', '5', '4', 'History museums', 'Organizations engaged in radio productions and broadcast, including public radio stations and radio stations that offer programming that is designed for community residents who are blind or visually impaired (radio reading services).', 'Yes'),
(23, 'A', '5', '6', 'Natural history & natural science museums', 'Organizations whose activities promote or provide access to a variety of visual arts. included are organizations that focus on an art form in a specific medium such as stained glass or textiles.', 'Yes'),
(24, 'A', '5', '7', 'Science & technology museums', 'Organizations that acquire, preserve, research, exhibit and provide for the educational use of works of art, objects or artifacts that are related to the study of zoology, biology, botany, mineralogy, geology and other natural sciences; history; archeology; or science and technology. use this code for types of museums not specified below.', 'Yes'),
(25, 'A', '6', '', 'Performing arts', 'Organizations that acquire, preserve and exhibit collections of objects including fine art, decorative art, folk/ethnic art and textiles that are collected primarily for their aesthetic qualities and their importance as representatives of a particular artistic tradition or style.', 'Yes'),
(26, 'A', '6', '1', 'Performing arts centers', 'Organizations that develop and maintain educational exhibits that are structured for the size, interests and intellectual capacity of young children. childrens museums are participatory and allow visitors to interact with the exhibits (touching, exploring, manipulating), and many offer organized lessons for groups of school children that focus on one or more of the exhibits. note: see also a57, science and technology museums, for other organizations with substantial activities and collections for children.', 'Yes'),
(27, 'A', '6', '2', 'Dance', 'Specialized museums, foundations and other organizations whose activities and collections preserve and promote the culture and history of a specific nationality, or racial or ethnic group, e.g. native americans.', 'Yes'),
(28, 'A', '6', '3', 'Ballet', 'Organizations that acquire, preserve, research and exhibit collections of objects including documents, tools, implements and furnishings that have significance in helping to interpret or understand the past. history museums may specialize in a specific era such as early greece or rome, a particular geographical region such as california or appalachia, a particular ethnic or cultural group such as native americans or a specific subject area such as costumes; and may contain items created or used by contemporary or historical figures.', 'Yes'),
(29, 'A', '6', '5', 'Theater', 'Organizations that acquire, preserve, research and exhibit collections of objects that have significance in the natural sciences including botany, zoology, geology and physical and cultural anthropology.', 'Yes'),
(30, 'A', '6', '8', 'Music', 'Organizations that develop and maintain educational exhibits which illustrate principles from mathematics and the physical sciences.', 'Yes'),
(31, 'A', '6', '9', 'Symphony orchestras', 'Organizations that provide access to the performing arts or a variety of art forms including the performing arts, and/or which present performing arts series. use this code for organizations devoted to art forms not specified below.', 'Yes'),
(32, 'A', '6', 'A', 'Opera', 'Organizations that operate facilities including theaters for the performing arts.', 'Yes'),
(33, 'A', '6', 'B', 'Singing & choral groups', 'Organizations that create and/or perform a variety of types of dance, including modern, folk, country and western, and square dancing.', 'Yes'),
(34, 'A', '6', 'C', 'Bands & ensembles', 'Dance organizations that create and/or perform primarily ballet.', 'Yes'),
(35, 'A', '6', 'E', 'Performing arts schools', 'Organizations whose primary activity is the production of plays. (organizations that present the productions of others should be classified as presenters. (a61)', 'Yes'),
(36, 'A', '7', '', 'Humanities', 'Organizations whose primary activity is the production of musical events, including concert series and music festivals.', 'Yes'),
(37, 'A', '8', '', 'Historical organizations', 'Organizations whose primary activity is the operation of a symphony <p> orchestra including youth symphonies.', 'Yes'),
(38, 'A', '8', '2', 'Historical societies & historic preservation', 'Organizations whose primary activity is the production of operas.', 'Yes'),
(39, 'A', '8', '4', 'Commemorative events', 'Organizations whose primary activity is the production of concerts including barbershop singing groups, glee clubs/choir groups, childrens choirs and other singing ensembles.', 'Yes'),
(40, 'A', '9', '', 'Arts services', 'Organizations that produce music not specifically covered by another category including marching bands, jazz groups, chamber music groups, blues, country music, ethnic music (e.g., brazilian, celtic, afro-pop, etc.), folk music, rhythm and blues.', 'Yes'),
(41, 'A', '9', '9', 'Arts, culture & humanities nec', 'Organizations that offer classes in the performing arts but do not confer academic degrees.', 'Yes'),
(42, 'B', '', '', 'Education', 'Organizations that promote awareness of and appreciation for history and historical artifacts. use this code for organizations that are not specified below.', 'Yes'),
(43, 'B', '0', '', 'Support services for education including public po', 'Support services for education including public policy, fundraising, professional services, management, research etc', 'Yes'),
(44, 'B', '1', '', 'Fund raising & fund distribution and financial ser', 'Na', 'Yes'),
(45, 'B', '1', '9', 'General support services for education', 'Consultation, training, and other forms of management assistance services to nonprofit groups within the education major group area.', 'Yes'),
(46, 'B', '2', '', 'Elementary & secondary schools', 'Learned societies, professional councils, and other organizations that bring together individuals or organizations with a common professional or vocational interest within the education major group area.', 'Yes'),
(47, 'B', '2', '1', 'Preschools', 'Organizations whose primary purpose is to conduct research and/or public policy analysis within the education major group area.', 'Yes'),
(48, 'B', '2', '4', 'Primary & elementary schools', 'Organizations existing as a support and fund-raising entity for a single institution within the education major group.', 'Yes'),
(49, 'B', '2', '5', 'Secondary & high schools', 'Organizations that raise and distribute funds for multiple organizations within the education major group area.', 'Yes'),
(50, 'B', '2', '8', 'Special education', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the education major group area.', 'Yes'),
(51, 'B', '2', '9', 'Charter schools', 'Preschool, elementary and secondary schools that provide a formal education for children and adolescents in kindergarten or first grade through grade twelve.', 'Yes'),
(52, 'B', '3', '', 'Vocational & technical schools', 'Separately organized preschools or nursery schools and/or kindergartens which provide foundation-level learning for children (usually age two through five and four and one half or five respectively) prior to entering the formal school setting.', 'Yes'),
(53, 'B', '4', '', 'Higher education', 'Schools classified as elementary by state and local practice and composed of any span of grades not above grade eight. includes preschools and kindergartens if they are an integral part of an elementary school or a regularly established school system.', 'Yes'),
(54, 'B', '4', '1', 'Two-year colleges', 'Schools comprising any span of grades beginning with the next grade following an elementary school and ending at or below grade 12. includes junior high schools or intermediate schools and high schools which provide formal instruction for students who want to prepare further education at the college level or for employment following graduation.', 'Yes'),
(55, 'B', '4', '2', 'Undergraduate colleges', 'Organizations that provide educational services including special placement and individualized programming, instruction and support services for children and youth who are gifted or have disabilities and require appropriately modified curricula, teaching methodologies and instructional materials in order to learn.', 'Yes'),
(56, 'B', '4', '3', 'Universities', 'Schools run independently of the traditional public school system but receiving public funding and operating by a charter. this performance contract details the schools mission, program, goals, students served, method of assessment, and ways to measure success.', 'Yes'),
(57, 'B', '5', '', 'Graduate & professional schools', 'Separately organized trade high schools or vocational centers that provide formal preparation for semiskilled, skilled, technical or professional occupations for high-school-aged students and, in some cases, adults who want to develop skills for employment.', 'Yes'),
(58, 'B', '6', '', 'Adult education', 'Educational institutions that provide opportunities for individuals to acquire a higher level of knowledge, skills and specialization in their chosen area of interest in a formal school setting. use this code for higher education institutions not specified below.', 'Yes'),
(59, 'B', '7', '', 'Libraries', 'Postsecondary educational institutions, known alternatively as community colleges or junior colleges and commonly organized into two-year programs, that offer instruction that has been adapted in content, level and schedule to meet the needs of the community in which they are located. community or junior colleges award an associates in arts (a.a.) certificate.', 'Yes'),
(60, 'B', '8', '', 'Student services', 'Educational institutions that offer college level courses of study that may lead to the customary bachelor of arts or science degree.', 'Yes'),
(61, 'B', '8', '2', 'Scholarships & student financial aid', 'Postsecondary educational institutions that offer postgraduate study at masters or doctorate levels in addition to an undergraduate program for people who meet entry level requirements and are interested in an advanced education. some institutions of university status are known as colleges or institutes.', 'Yes'),
(62, 'B', '8', '3', 'Student sororities & fraternities', 'Separately incorporated postsecondary educational institutions provide opportunities for people who have completed their undergraduate education to receive advanced, postgraduate training in a professional field leading to a masters degree or doctorate.', 'Yes'),
(63, 'B', '8', '4', 'Alumni associations', 'Institutions outside the formal system of regular schools, colleges, universities and technical/trade schools that provide opportunities for adults to develop basic learning and communication skills, complete their high school education, expand their knowledge in a particular field or discipline or develop skills in a new area of interest.', 'Yes'),
(64, 'B', '9', '', 'Educational services', 'Facilities which house a collection of materials including books, manuscripts, journals, government documents and non-print formats such as paintings, musical recordings, videotapes, films and data files which are organized for access by a targeted population.', 'Yes'),
(65, 'B', '9', '2', 'Remedial reading & encouragement', 'Organizations that provide services, facilities and programs that support student needs, foster student learning and personal development, create a healthy and diverse community, and enrich student life.', 'Yes'),
(66, 'B', '9', '4', 'Parent & teacher groups', 'Organizations that enable students who demonstrate financial need to obtain the financial assistance they require to meet their educational and living expenses while in school.', 'Yes'),
(67, 'B', '9', '9', 'Education nec', 'Associations for male and female students which are chapters of national or international organizations, have secret rites and restricted membership, and may undertake, as a part of their activities, community improvement or charitable projects. included are student sororities and fraternities and honorary societies that represent specific academic disciplines.', 'Yes'),
(68, 'C', '', '', 'Environment', 'Organizations whose members are graduates of a particular educational institution who provide support for the institution in the form of financial contributions, student recruitment efforts, promotional activities, fund-raising events and continued ties with the academic program.', 'Yes'),
(69, 'C', '0', '', 'Support services for environment including public ', 'Support services for environment including public policy, fundraising, professional services, management, research etc', 'Yes'),
(70, 'C', '1', '', 'Fund raising & fund distribution and financial ser', 'Private nonprofit organizations whose primary purpose is to preserve, protect and improve the environment.', 'Yes'),
(71, 'C', '1', '9', 'General support services for environment', 'Consultation, training, and other forms of management assistance services to nonprofit groups within the environment major group area.', 'Yes'),
(72, 'C', '2', '', 'Pollution abatement & control', 'Learned societies, professional councils, and other organizations that bring together individuals or organizations with a common professional or vocational interest within the environment major group area.', 'Yes'),
(73, 'C', '2', '7', 'Recycling', 'Organizations whose primary purpose is to conduct research and/or public policy analysis within the environment major group area.', 'Yes'),
(74, 'C', '3', '', 'Natural resources conservation & protection', 'Organizations existing as a support and fund-raising entity for a single institution within the environment major group area.', 'Yes'),
(75, 'C', '3', '2', 'Water resources, wetlands conservation & managemen', 'Organizations that raise and distribute funds for multiple organizations within the environment major group area.', 'Yes'),
(76, 'C', '3', '4', 'Land resources conservation', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the environment major group area.', 'Yes'),
(77, 'C', '3', '5', 'Energy resources conservation & development', 'Organizations which seek to ensure that communities have a clean and healthful environment that is free from air and water pollution, pesticides and other hazardous substances, damaging radiation and excessive levels of noise.', 'Yes'),
(78, 'C', '3', '6', 'Forest conservation', 'Organizations that collect and process paper, aluminum, glass, and other materials that can be recycled and reused.', 'Yes'),
(79, 'C', '4', '', 'Botanical, horticultural & landscape services', 'Organizations that protect our natural resources from abuse, neglect, waste or exploitation and preserve their availability for future generations.', 'Yes'),
(80, 'C', '4', '1', 'Botanical gardens & arboreta', 'Organizations that preserve and protect water resources from indiscriminate waste and ensure that the supply of quality water is adequate to meet the needs of the public, agriculture and industry. also included are organizations that preserve and manage coastal lands including shorelines, coastal waters and lands extending inland from the shore which affect coastal waters; bays, lakes, rivers, wetlands, estuaries, watersheds and other aquatic habitats.', 'Yes'),
(81, 'C', '4', '2', 'Garden clubs', 'Organizations that preserve and protect endangered land resources from indiscriminate development, destruction or decay and which manage the utilization of renewable and nonrenewable resources to ensure ongoing availability. included are conservation of the nations forests, rangeland, vegetation, deserts, wild and scenic rivers and other wilderness areas and open land spaces; and reestablishment of areas that have been devastated by destructive activities such as strip mining or other destructive activities.', 'Yes'),
(82, 'C', '5', '', 'Environmental beautification', 'Organizations that conserve existing energy resources, ensure efficient use of available energy and develop new energy resources while protecting the quality of the environment.', 'Yes'),
(83, 'C', '6', '', 'Environmental education', 'Organizations involved with forest lands and the protection of the nations forests from insects, disease, fire, erosion, air pollution and other destructive forces.', 'Yes'),
(84, 'C', '9', '9', 'Environment nec', 'Organizations that are involved in the cultivation of plant life for a variety of purposes.', 'Yes'),
(85, 'D', '', '', 'Animal-related', 'Organizations that plant, maintain and display for public study and enjoyment collections of flowers, trees, shrubs and ground cover, some of which are rare and exotic.', 'Yes'),
(86, 'D', '0', '', 'Support services for animal related organizations ', '', 'Yes'),
(87, 'D', '1', '1', 'Fund raising & fund distribution and financial ser', 'Private nonprofit organizations whose primary purpose is to provide for the care, protection and control of wildlife and domestic animals that are a part of the living environment; to help people develop an understanding of their pets; and to train animals for purposes of showing.', 'Yes'),
(88, 'D', '1', '9', 'General support services for animal-related', 'Consultation, training, and other forms of management assistance services to nonprofit groups within the animal-related major group area.', 'Yes'),
(89, 'D', '2', '', 'Animal protection & welfare', 'Learned societies, professional councils, and other organizations that bring together individuals or organizations with a common professional or vocational interest within the animal-related major group area.', 'Yes'),
(90, 'D', '3', '', 'Wildlife preservation & protection', 'Organizations whose primary purpose is to conduct research and/or public policy analysis within the animal-related major group area.', 'Yes'),
(91, 'D', '3', '1', 'Protection of endangered species', 'Organizations existing as a support and fund-raising entity for a single institution within the animal-related major group area.', 'Yes'),
(92, 'D', '3', '2', 'Bird sanctuaries', 'Organizations that raise and distribute funds for multiple organizations within the animal-related major group area.', 'Yes'),
(93, 'D', '3', '3', 'Fisheries resources', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the animal-related major group area.', 'Yes'),
(94, 'D', '3', '4', 'Wildlife sanctuaries', 'Organizations such as animal shelters that provide for the humane care, protection and control of animals and which investigate instances of cruelty to animals.', 'Yes'),
(95, 'D', '4', '', 'Veterinary services', 'Organizations that are responsible for the conservation, protection, care and management of fish and wildlife resources and their habitats. use this code for organizations that provide wildlife preservation services not specified below or which deal with multiple populations of wildlife.', 'Yes'),
(96, 'D', '5', '', 'Zoos & aquariums', 'Organizations that identify and promote laws for the protection of species of birds, animals, fish or other wildlife that are at risk of extinction; and/or which sponsor programs for breeding endangered species in captivity and releasing them to selected habitats in the wild in which they are given a better chance for survival.', 'Yes'),
(97, 'D', '6', '', 'Animal services nec', 'Organizations that provide for the conservation, protection and management of different species of wild birds by establishing a system of preserves that are set aside for their habitation and protected from human depredation and interference.', 'Yes'),
(98, 'D', '6', '1', 'Animal training', 'Organizations that provide for the conservation, protection and management of different species of fish by establishing coastal, lake, reservoir or other inland fisheries where different species of fish are hatched in protected environments and used to stock public waters that have been depleted.', 'Yes'),
(99, 'D', '9', '9', 'Animal-related nec', 'Organizations that provide for the conservation, protection and management of different species of wild animals by establishing a system of preserves that are set aside for their habitation and protected from human depredation and interference.', 'Yes'),
(100, 'E', '', '', 'Health care', 'Organizations that house collections of living animals, birds, reptiles, living aquatic plants and animals including fish, shellfish, and shore birds, insects and other wildlife for the purpose of study and public viewing.', 'Yes'),
(101, 'E', '0', '', 'Support services for health care related organizat', '', 'Yes'),
(102, 'E', '1', '1', 'Fund raising & fund distribution and financial ser', 'Organizations whose activities focus on influencing public policy within the health - general and rehabilitative major group area. includes a variety of activities from public education and influencing public opinion to lobbying national and state legislatures.', 'Yes'),
(103, 'E', '1', '9', 'General support services for health care', 'Learned societies, professional councils, and other organizations that bring together individuals or organizations with a common professional or vocational interest within the health - general and rehabilitative major group area.', 'Yes'),
(104, 'E', '2', '', 'Hospitals', 'Organizations whose primary purpose is to conduct research and/or public policy research within the health - general and rehabilitative major group area.', 'Yes'),
(105, 'E', '2', '1', 'Community health systems', 'Organizations existing as a support and fund-raising entity for single institutions, multihospital health care systems, and similar diversified health systems comprised of closely-affiliated organizations within the health care major group area.', 'Yes'),
(106, 'E', '2', '2', 'General hospitals', 'Organizations that raise and distribute funds for multiple organizations within the health - general and rehabilitative major group area.', 'Yes'),
(107, 'E', '2', '4', 'Specialty hospitals', 'Organizations that provide all forms of support except for financial assistance, fund raising, or patient care services for other organizations within the health general and rehabilitative major group area.', 'Yes'),
(108, 'E', '3', '', 'Ambulatory & primary health care', 'Twenty-four hour medical institutions that provide diagnostic and treatment services for people whose illnesses require an overnight stay. most hospitals also provide a variety of services on an outpatient basis. use this code for hospitals not specified below.', 'Yes'),
(109, 'E', '3', '1', 'Group health practices', 'Multihospital health care systems that have two or more hospitals owned, leased, sponsored, or managed by a central organization. also includes parent companies of diversified single hospital systems that provide comprehensive management and support services for the hospital. (rev. 9/2005)', 'Yes'),
(110, 'E', '3', '2', 'Community clinics', 'Health care facilities that are licensed to operate twenty-four hours per day and offer diagnostic and treatment services as well as emergency and critical care services for people who have illnesses or injuries which require immediate, short-term intervention.', 'Yes'),
(111, 'E', '4', '', 'Reproductive health care', 'Health care facilities like orthopedic hospitals or cancer hospitals that provide diagnostic and treatment services on an inpatient basis for people who have specified medical conditions.', 'Yes'),
(112, 'E', '4', '2', 'Family planning', 'Health centers, clinics, and other facilities that provide walk-in, walk-out diagnostic and treatment services for people whose care does not require confinement or a hospital stay. use this code for types of outpatient facilities or services not specified below.', 'Yes'),
(113, 'E', '5', '', 'Rehabilitative care', 'Organizations that provide both health care services and underwrite health and medical insurance. also included are medical groups which provide health care for hmo members on a contract with the hmo and physician practice groups generally associated with teaching, research, and public hospitals.', 'Yes'),
(114, 'E', '6', '', 'Health support', 'Outpatient facilities, many previously known as free clinics, established by the community rather than a hospital which provide basic medical care including physical examinations, immunizations, family planning, nutrition assistance and diagnosis and treatment of common ailments. services are available on an ability-to-pay basis and target low-income and indigent community residents.', 'Yes'),
(115, 'E', '6', '1', 'Blood banks', 'Organizations that provide medical, educational and counseling services which relate to the conception, delivery and care of offspring. use this code for organizations other than family planning centers that offer reproductive health services.', 'Yes'),
(116, 'E', '6', '2', 'Emergency medical services & transport', 'Organizations that provide assistance for people who want to control the size of their families and the spacing of their children, either through some form of birth control or naturally. use this code for planned parenthood organizations.', 'Yes'),
(117, 'E', '6', '5', 'Organ & tissue banks', 'Organizations that provide, on an outpatient basis, a combination of treatment and education services to restore maximum functioning, a sense of well-being and a personally satisfying level of independence for individuals who have temporary or permanent disabilities. use this code for easter seal society.', 'Yes'),
(118, 'E', '7', '', 'Public health', 'Organizations that provide equipment, services or other forms of support which are supplemental to the treatment or rehabilitation of people who have illnesses, injuries or disabilities; or which are instrumental in the prevention of illnesses, injuries or disabilities prior to their occurrence. use this code for organizations that provide a wide range of health support services or which offer services not specified below.', 'Yes'),
(119, 'E', '8', '', 'Health (general & financing)', 'Organizations that acquire, process, type, transport and store whole blood and blood products including red blood cells, white blood cells, platelets and plasma constituents for use by people who need transfusions; and which conduct pretransfusion compatibility tests to ensure that blood transfusions, when necessary, are as safe as possible.', 'Yes'),
(120, 'E', '8', '6', 'Patient & family support', 'Organizations that provide pre-hospital emergency medical care and rapid transportation to health care facilities.', 'Yes'),
(121, 'E', '9', '', 'Nursing', 'Organizations that accept donated hearts, kidneys, livers, skin and other organs and tissue for use in transplant operations.', 'Yes'),
(122, 'E', '9', '1', 'Nursing facilities', '', 'Yes'),
(123, 'E', '9', '2', 'Home health care', 'Organizations that inform the public of health and safety hazards and measures for furthering the early detection, treatment or rehabilitation of people who have an illness, injury or disability.', 'Yes'),
(124, 'E', '9', '9', 'Health care nec', 'Organizations that are concerned primarily with one or more aspects of health financing or that provide services which relate to health care in general.', 'Yes'),
(125, 'F', '', '', 'Mental health & crisis intervention', 'Organizations that provide support services to patients and their families. programs can include social and recreational activities for people who are recovering from surgery or a serious illnesses; supportive services for children who are ill and for their families which enable family members to remain with a child who is hospitalized; family and sibling support groups, and programs which attempt to make a gravely or terminally ill childâ€™s final days, weeks and months more pleasant. (rev. 9/2005)', 'Yes'),
(126, 'F', '0', '', 'Support services for mental health & crisis interv', '', 'Yes'),
(127, 'F', '1', '', 'Fund raising & fund distribution and financial ser', 'Na', 'Yes'),
(128, 'F', '1', '9', 'General support services for mental health & crisi', 'Consultation, training, and other forms of management assistance services to nonprofit groups within the mental health, crisis intervention major group area.', 'Yes'),
(129, 'F', '2', '', 'Substance abuse dependency, prevention & treatment', 'Learned societies, professional councils, and other organizations that bring together individuals or organizations with a common professional or vocational interest within the mental health, crisis intervention major group area.', 'Yes'),
(130, 'F', '2', '1', 'Substance abuse prevention', 'Organizations whose primary purpose is to conduct research and/or public policy research within the mental health, crisis intervention major group area.', 'Yes'),
(131, 'F', '2', '2', 'Substance abuse treatment', 'Organizations existing as a support and fund-raising entity for a single institution within the mental health & crisis intervention major group area.', 'Yes'),
(132, 'F', '3', '', 'Mental health treatment', 'Organizations that raise and distribute funds for multiple organizations within the mental health, crisis intervention major group area.', 'Yes'),
(133, 'F', '3', '1', 'Psychiatric hospitals', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within mental health, crisis intervention major group area.', 'Yes'),
(134, 'F', '3', '2', 'Community mental health centers', 'Organizations that provide preventive, diagnostic and inpatient, outpatient and residential treatment services as well as transitional support for people who have a physical and/or psychological dependency on alcohol and/or drugs. use this code for organizations that provide both substance abuse prevention and treatment services.', 'Yes'),
(135, 'F', '3', '3', 'Residential mental health treatment', 'Organizations that provide substance abuse education programs for people who are at risk for substance abuse in an effort to prevent their involvement with drugs and/or alcohol.', 'Yes'),
(136, 'F', '4', '', 'Hot lines & crisis intervention', 'Organizations that provide inpatient, outpatient or residential treatment services for individuals who have a physical and/or psychological dependency on alcohol and/or drugs.', 'Yes'),
(137, 'F', '4', '2', 'Sexual assault services', 'Organizations that provide preventive, diagnostic and treatment services in a variety of community and hospital-based settings to help people to achieve and maintain a state of emotional well-being, personal empowerment and the skills to cope with everyday demands without excessive stress. use this code for types of mental health organizations not specified below or for organizations that combine multiple types of care within the same facility.', 'Yes'),
(138, 'F', '5', '', 'Addictive disorders nec', 'Organizations that provide diagnostic and inpatient treatment services for individuals who have acute or chronic mental or emotional disturbances, who require hospitalization.', 'Yes'),
(139, 'F', '5', '2', 'Smoking addiction', 'Neighborhood-based organizations that offer counseling, medication and other mental health services for people who have acute or chronic mental or emotional disturbances.', 'Yes'),
(140, 'F', '5', '3', 'Eating disorders & addictions', 'Organizations that provide a therapeutic living environment in community-based facilities for adults or children with emotional and/or behavioral problems who require a structured, supervised treatment program which may include individual, group, family and other treatment modalities as appropriate.', 'Yes'),
(141, 'F', '5', '4', 'Gambling addiction', 'Organizations that provide in-person or telephone assistance for people who are in acute emotional distress; who are a danger to themselves or to others; who are having suicidal feelings; or who are hysterical, frightened or otherwise unable to cope with a problem that requires immediate action. use this code for crisis intervention services or hotlines not specified below or for organizations that offer multiple types of crisis intervention, hotline services.', 'Yes'),
(142, 'F', '6', '', 'Counseling', 'Organizations that provide telephone crisis intervention services or crisis, short-term and/or ongoing in-person counseling for people who have been sexually assaulted.', 'Yes'),
(143, 'F', '7', '', 'Mental health disorders', 'Organizations that provide counseling, medical treatment (where indicated) and other supportive services for individuals who have a psychological dependency involving a particular pattern of behavior, e.g., spending money, sexual compulsions and workaholic behavior.', 'Yes'),
(144, 'F', '8', '', 'Mental health associations', 'Organizations that utilize a variety of techniques to help people who wish to control their dependence on nicotine and give up substances containing nicotine. also included are smoking education/prevention programs that help persuade people to avoid the habit before they start.', 'Yes'),
(145, 'F', '9', '9', 'Mental health & crisis intervention nec', 'Organizations that provide diagnostic and treatment services for individuals who have anorexia nervosa, bulimarexia, bulimia or a related eating disorder.', 'Yes'),
(146, 'G', '', '', 'Diseases, disorders & medical disciplines', 'Organizations that provide emotional support, information and guidance for people who are having difficulty controlling their compulsion to gamble.', 'Yes'),
(147, 'G', '0', '', 'Support services for diseases, disorders & medical', '', 'Yes'),
(148, 'G', '1', '', 'Fund raising & fund distribution and financial ser', 'Na', 'Yes'),
