(150, 'G', '2', '', 'Birth defects & genetic diseases', 'Learned societies, professional councils, and other organizations that bring together individuals or organizations with a common professional or vocational interest within the voluntary health associations and medical disciplines major group area.', 'Yes'),
(151, 'G', '2', '5', 'Down syndrome', 'Organizations whose primary purpose is to conduct research and/or public policy research within the voluntary health associations and medical disciplines major group area.', 'Yes'),
(152, 'G', '3', '', 'Cancer', 'Organizations existing as a support and fund-raising entity for a single institution within the voluntary health associations and medical disciplines major group area.', 'Yes'),
(153, 'G', '3', '2', 'Breast cancer', 'Organizations that raise and distribute funds for multiple organizations within the voluntary health associations and medical disciplines major group area.', 'Yes'),
(154, 'G', '4', '', 'Diseases of specific organs', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the voluntary health associations and medical disciplines major group area.', 'Yes'),
(155, 'G', '4', '1', 'Eye diseases, blindness & vision impairments', 'Voluntary health organizations active in the prevention or treatment of illnesses or conditions that are hereditary and passed from parent to offspring. use this code for organizations that focus on a wide variety of genetic disorders or on genetic disorders not specified below.', 'Yes'),
(156, 'G', '4', '2', 'Ear & throat diseases', 'Voluntary health organizations active in the prevention or treatment of down syndrome, a hereditary condition that results in mental retardation.', 'Yes'),
