(158, 'G', '4', '4', 'Kidney diseases', 'Voluntary health organizations active in the prevention or treatment of breast cancer.', 'Yes'),
(159, 'G', '4', '5', 'Lung diseases', 'Voluntary health organizations active in the prevention or treatment of diseases and conditions that affect specific organs or organ systems in the body. use this code for organizations that focus on diseases that affect a wide range of organs or organ systems or on those not specified below.', 'Yes'),
(160, 'G', '4', '8', 'Brain disorders', 'Voluntary health organizations active in the prevention or treatment of blindness and diseases or other conditions that affect the eyes. the associated medical specialty is ophthalmology.', 'Yes'),
(161, 'G', '5', '', 'Nerve, muscle & bone diseases', 'Voluntary health organizations active in the prevention or treatment of diseases or conditions that affect the head and neck including the ears, the respiratory and upper alimentary systems, the face, the jaws and related structures. the related medical specialty is otolaryngology.', 'Yes'),
(162, 'G', '5', '1', 'Arthritis', 'Voluntary health organizations active in the prevention or treatment of diseases or conditions, including stroke, that affect the heart, lungs and blood vessels. the related medical specialty is cardiovascular medicine, a subspecialty of internal medicine.', 'Yes'),
(163, 'G', '5', '4', 'Epilepsy', 'Voluntary health organizations active in the prevention or treatment of diseases or conditions that affect the kidneys. the related medical specialty is nephrology, a subspecialty of internal medicine.', 'Yes'),
(164, 'G', '6', '', 'Allergy-related diseases', 'Voluntary health organizations active in the prevention or treatment of diseases or conditions that affect the lungs. the related medical specialty is pulmonary disease specialists.', 'Yes'),
(165, 'G', '6', '1', 'Asthma', 'Voluntary health organizations active in the prevention or treatment of diseases or conditions including brain injuries that affect the brain.', 'Yes'),
(166, 'G', '7', '', 'Digestive diseases & disorders', 'Voluntary health organizations active in the prevention or treatment of diseases or conditions that affect the nerves, muscles or bones. use this code for organizations that focus on a wide variety of nerve, muscle and bone diseases or those not specified below. the related medical specialty is orthopedic surgery.', 'Yes'),
(167, 'G', '8', '', 'Specifically named diseases', 'Voluntary health organizations active in the prevention or treatment of arthritis (including osteoarthritis and rheumatoid arthritis), an inflammatory condition affecting the joints. the related medical specialty is rheumatology, a subspecialty of internal medicine, though rheumatology is broader and covers more conditions than arthritis.', 'Yes'),
(168, 'G', '8', '1', 'Aids', 'Voluntary health organizations active in the prevention or treatment of epilepsy, a recurrent paroxysmal disorder of cerebral function that is characterized by sudden brief interruptions in or complete loss of consciousness, motor activity and/or sensory phenomena.', 'Yes'),
(169, 'G', '8', '3', 'Alzheimerâ€™s disease', 'Voluntary health organizations active in the prevention or treatment of diseases and conditions that involve hypersensitivity to substances that do not normally cause a reaction.', 'Yes'),
(170, 'G', '8', '4', 'Autism', 'Voluntary health organizations active in the prevention or treatment of asthma, a disorder of the bronchial system that is characterized by labored breathing and wheezing.', 'Yes'),
(171, 'G', '9', '0', 'Medical disciplines', 'Voluntary health organizations active in the prevention or treatment of diseases and conditions such as abdominal pain, ulcers, diarrhea or jaundice that affect the digestive system including the stomach, bowels, liver, gallbladder and related organs. the related medical specialty is gastroenterology, a subspecialty of internal medicine.', 'Yes'),
(172, 'G', '9', '2', 'Biomedicine & bioengineering', 'Voluntary health organizations active in the prevention or treatment of specifically named diseases and conditions. use this code for named diseases not specified below.', 'Yes'),
(173, 'G', '9', '4', 'Geriatrics', 'Voluntary health organizations active in the prevention or treatment of aids, a disease that impairs the functioning of the bodys immune system, leaving affected individuals vulnerable to illnesses that would not otherwise occur.', 'Yes'),
(174, 'G', '9', '6', 'Neurology & neuroscience', 'Voluntary health organizations active in the prevention or treatment of alzheimers disease, a form of presenile dementia which is caused by atrophy of the frontal and occipital lobes of the brain.', 'Yes'),
(175, 'G', '9', '8', 'Pediatrics', 'Voluntary health organizations active in the prevention or treatment of autism, a developmental disability, usually evident by age three, which affects a childs ability to communicate, understand language, play and relate to others.', 'Yes'),
(176, 'G', '9', 'B', 'Surgical specialties', 'Organizations that represent physicians who have special training and expertise in one clinical area of practice which focuses on a specific age group, an organ system of the body, or on complex scientific techniques developed to diagnose or treat certain types of disorders. use this code for organizations that represent a wide variety of medical disciplines or those that are not specified below.', 'Yes'),
(177, 'H', '', '', 'Medical research', 'All medical research', 'Yes'),
(178, 'H', '0', '', 'Support services for medical research related serv', '', 'Yes'),
(179, 'H', '1', '', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a support and fund-raising entity for a single institution within the medical research major group area.', 'Yes'),
(180, 'H', '1', '9', 'General support services for medical research', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the medical research major group area.', 'Yes'),
(181, 'H', '2', '', 'Birth defects & genetic diseases research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of any of a number of illnesses or conditions that are hereditary and passed from parent to offspring.', 'Yes'),
(182, 'H', '2', '5', 'Down syndrome research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of down syndrome, a hereditary condition that results in mental retardation.', 'Yes'),
(183, 'H', '3', '', 'Cancer research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of cancer. use this code for organizations whose research focuses on a wide variety of forms of cancer.', 'Yes'),
(184, 'H', '3', '2', 'Breast cancer research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of breast cancer.', 'Yes'),
(185, 'H', '4', '', 'Diseases of specific organs research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of diseases and conditions that affect specific organs or organ systems in the body. use this code for organizations whose research focuses on diseases that affect a wide range of organs or organ systems or on those not specified below.', 'Yes'),
(186, 'H', '4', '1', 'Eye diseases, blindness & vision impairments resea', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of diseases and conditions that affect eyes. the associated medical specialty is ophthalmology.', 'Yes'),
(187, 'H', '4', '2', 'Ear & throat diseases research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of diseases and conditions that affect the head and neck including the ears, the respiratory and upper alimentary systems, the face, the jaws and related structures. the related medical specialty is otolaryngology.', 'Yes'),
(188, 'H', '4', '3', 'Heart & circulatory system diseases & disorders re', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of diseases or conditions, including stroke, that affect the heart, lungs and blood vessels. the related medical specialty is cardiovascular medicine, a subspecialty of internal medicine.', 'Yes'),
(189, 'H', '4', '4', 'Kidney diseases research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of diseases and conditions that affect the kidneys. the related medical specialty is nephrology, a subspecialty of internal medicine.', 'Yes'),
(190, 'H', '4', '5', 'Lung diseases research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of diseases and conditions that affect the lungs. the related medical specialty is pulmonary disease specialists.', 'Yes'),
(191, 'H', '4', '8', 'Brain disorders research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of diseases and conditions that affect the brain.', 'Yes'),
(192, 'H', '5', '', 'Nerve, muscle & bone diseases research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of diseases or conditions that affect the nerves, muscles or bones. use this code for organizations whose research focuses on a wide variety of nerve, muscle or bone diseases or on those not specified below. the related medical specialty is orthopedic surgery.', 'Yes'),
(193, 'H', '5', '1', 'Arthritis research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of arthritis (including osteoarthritis and rheumatoid arthritis), an inflammatory condition affecting the joints. the related medical specialty is rheumatology, a subspecialty of internal medicine, though rheumatology is broader and covers more conditions than arthritis.', 'Yes'),
(194, 'H', '5', '4', 'Epilepsy research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of epilepsy, a recurrent paroxysmal disorder of cerebral function that is characterized by sudden brief interruptions in or complete loss of consciousness, motor activity and/or sensory phenomena.', 'Yes'),
(195, 'H', '6', '', 'Allergy-related diseases research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of diseases and conditions that involve hypersensitivity to substances that do not normally cause a reaction. use this code for organizations whose research focuses on a wide variety of allergy-related diseases or on specific allergy-related diseases.', 'Yes'),
(196, 'H', '6', '1', 'Asthma research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of asthma, a disorder of the bronchial system that is characterized by labored breathing and wheezing.', 'Yes'),
(197, 'H', '7', '', 'Digestive diseases & disorders research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of diseases and conditions such as abdominal pain, ulcers, diarrhea or jaundice that affect the digestive system including the stomach, bowels, liver, gallbladder and related organs. the related medical specialty is gastroenterology, a subspecialty of internal medicine.', 'Yes');
INSERT INTO `i2D_D_Category` (`i2D_D_CATEGORY_ID`, `i2D_D_CATEGORY_CODE`, `i2D_D_SUB_CATEGORY_CODE`, `i2D_D_CHILD_CATEGORY_CODE`, `i2D_D_CATEGORY_NAME`, `i2D_D_CATEGORY_DESCIPTION`, `i2D_D_ACTIVE`) VALUES
(198, 'H', '8', '', 'Specifically named diseases research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of specifically named diseases and conditions. use this code for organizations that conduct research on a multiplicity of named diseases or on named diseases not specified below.', 'Yes'),
(199, 'H', '8', '1', 'Aids research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of aids, a disease that impairs the functioning of the bodys immune system, leaving affected individuals vulnerable to illnesses that would not otherwise occur.', 'Yes'),
(200, 'H', '8', '3', 'Alzheimers disease research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of alzheimers disease, a form of presenile dementia which is caused by atrophy of the front and occipital lobes of the brain.', 'Yes'),
(201, 'H', '8', '4', 'Autism research', 'Organizations that conduct research which can be used to improve the prevention, diagnosis and treatment of autism, a developmental disability, usually evident by age three, which affects a childs ability to communicate, understand language, play and relate to others.', 'Yes'),
(202, 'H', '9', '', 'Medical disciplines research', 'Organizations that conduct research which can be used to improve the options available to physicians who have special training and expertise in one clinical area of practice which focuses on a specific age group, an organ system of the body, or complex scientific techniques developed to diagnose or treat certain types of disorders. use this code for organizations whose research covers a wide variety of medical disciplines or those that are not specified below.', 'Yes'),
(203, 'H', '9', '2', 'Biomedicine & bioengineering research', 'Organizations that conduct research which can be used to improve the options available to physicians who have advanced training in the development, implantation and utilization of cardiac pacemakers, cochlear implants and other hearing aids, artificial limbs and joints and other similar devices.', 'Yes'),
(204, 'H', '9', '4', 'Geriatrics research', 'Organizations that conduct research which can be used to improve the options available to physicians who have advanced training in the medical specialty which provides preventive, diagnostic and treatment services for elderly individuals who have diseases or conditions that are associated with the aging process.', 'Yes'),
(205, 'H', '9', '6', 'Neurology & neuroscience research', 'Organizations that conduct research which can be used to improve the options available to physicians who have advanced training in the medical specialty which provides comprehensive medical management including preventive, diagnostic and treatment services for individuals who have diseases or injuries that affect the central, peripheral or autonomic nervous systems including the brain, cranial nerves, spinal cord, spinal nerves and other related structures.', 'Yes'),
(206, 'H', '9', '8', 'Pediatrics research', 'Organizations that conduct research which can be used to improve the options available to physicians who have advanced training in the biological, social and environmental factors that have an influence on a developing child and expertise in diagnosing and treating acute and chronic diseases that are common to children and youth.', 'Yes'),
(207, 'H', '9', 'B', 'Surgical specialties research', 'Organizations that conduct research which can be used to improve the options available to physicians who have advanced training in the medical specialty which diagnoses conditions which require surgical intervention and provide preoperative, operative and postoperative care for surgical patients.', 'Yes'),
(208, 'H', '9', '9', 'Medical research n.e.c.', 'Use this code for organizations that clearly provide services related to research regarding diseases, disorders or medical specialties where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(209, 'I', '', '', 'Crime & legal-related', 'Na', 'Yes'),
(210, 'I', '0', '', 'Support services for crime & legal-related related', '', 'Yes'),
(211, 'I', '1', '', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a fund-raising entity for a single institution within the crime & legal-related major group area.', 'Yes'),
(212, 'I', '1', '9', 'General support services for crime & legal-related', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the crime, legal related major group area.', 'Yes'),
(213, 'I', '2', '', 'Crime prevention', 'Organizations that provide information and services that help the public protect themselves from crime or which prevent its occurrence. also included are organizations that provide a mechanism for reporting crimes. use this code for crime prevention programs not specified below.', 'Yes'),
(214, 'I', '2', '1', 'Youth violence prevention', 'Organizations that offer a variety of activities for youth who have demonstrated or are at risk for behavior which is likely to be unlawful or to involve them in the juvenile justice system. also included are community councils, coalitions and other groups whose primary purpose is to prevent delinquency.', 'Yes'),
(215, 'I', '2', '3', 'Drunk driving-related', 'Organizations that provide first and multiple offender drunk driving programs for adults and juveniles or which offer transportation services for drinking drivers. also includes community action groups like madd that are against drunk driving.', 'Yes'),
(216, 'I', '3', '', 'Correctional facilities', 'Privately operated, community-based nonprofit correctional facilities for adults or juveniles who have been sentenced to imprisonment after conviction for an offense. these facilities serve the same function as government-operated programs, and most operate on a contract with the county or the state.', 'Yes'),
(217, 'I', '3', '1', 'Half-way houses for offenders & ex-offenders', 'Community-based residential facilities which allow adult and juvenile offenders with satisfactory behavior to transition back to the community during the last months of their sentences or which provide congregate living arrangements and supportive services for ex-offenders to help them successfully reenter the community and become self-sufficient. these facilities are known as work release centers, prerelease centers, rehabilitation centers and group homes for juvenile offenders or status offenders.', 'Yes'),
(218, 'I', '4', '', 'Rehabilitation services for offenders', 'Organizations that provide counseling, job seeking assistance and other nonresidential supportive services that help adult and/or juvenile offenders re-integrate into the community following their release from a correctional facility. use this code for rehabilitation services not specified below.', 'Yes'),
(219, 'I', '4', '3', 'Inmate support', 'Organizations that provide emotional support, friendship, advice and guidance or other types of support for inmates while they are incarcerated and/or which facilitate contact between inmates and family members.', 'Yes'),
(220, 'I', '4', '4', 'Prison alternatives', 'Organizations that provide intensive treatment and rehabilitation services for adult or juvenile offenders. the focus of the service is on rehabilitation of the offender rather than preparation for release into the community.', 'Yes'),
(221, 'I', '5', '', 'Administration of justice', 'Organizations that are concerned with court administration; court reform including the rights and privileges of prisoners, incarceration alternatives and other criminal justice issues; and alternatives to litigation.', 'Yes'),
(222, 'I', '5', '1', 'Dispute resolution & mediation', 'Organizations that provide mediation services which help individuals who are having a dispute discuss the situation and reach an agreement without resorting to litigation.', 'Yes'),
(223, 'I', '6', '', 'Law enforcement', 'Law enforcement associations, advisory councils or other nonprofit community groups that provide advice and direction for police departments; auxiliaries or other community-based organizations that collect and disburse money in aid of injured police officers or in support of local law enforcement activities; and other nonprofit groups that have an interest in law enforcement issues.', 'Yes'),
(224, 'I', '7', '', 'Protection against abuse', 'Organizations that attempt to reduce the incidence of child abuse, elder abuse and spouse abuse in family settings through educational interventions which may focus on children of various ages, parents, people who work with families and/or the community at large.', 'Yes'),
(225, 'I', '7', '1', 'Spouse abuse prevention', 'Organizations that deal specifically with the prevention of domestic violence through educational interventions which may focus on batterers, people at risk for domestic violence, people who work with battered women and/or the community at large.', 'Yes'),
(226, 'I', '7', '2', 'Child abuse prevention', 'Organizations that deal specifically with the prevention of child abuse including incest through educational interventions which may focus on children of various ages, parents, people who work with families and/or the community at large.', 'Yes'),
(227, 'I', '7', '3', 'Sexual abuse prevention', 'Organizations that deal specifically with the prevention of sexual assault (for adults and children).', 'Yes'),
(228, 'I', '8', '', 'Legal services', 'Organizations that provide general legal aid regarding criminal and/or civil matters at little or no cost for individuals who are economically disadvantaged.', 'Yes'),
(229, 'I', '8', '3', 'Public interest law', 'Organizations that primarily handle class action litigation and lawsuits related to issues of interest to the public in general rather than assisting individuals.', 'Yes'),
(230, 'I', '9', '9', 'Crime & legal-related n.e.c.', 'Use this code for organizations that clearly provide crime and legal related services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(231, 'J', '', '', 'Employment', 'Na', 'Yes'),
(232, 'J', '0', '', 'Support services for employment related services a', '', 'Yes'),
(233, 'J', '1', '', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a fund-raising entity for a single institution within the employment major group area.', 'Yes'),
(234, 'J', '1', '9', 'General support services for employment', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the employment, job related major group area.', 'Yes'),
(235, 'J', '2', '', '', 'Organizations that help people prepare for, find, secure and retain suitable employment. use this code for organizations that provide a wide range of employment services or those that offer employment-related services not specified below. includes: employment placement agencies; job development organizations including those for youth and people with disabilities; retraining; and senior community service employment programs', 'Yes'),
(236, 'J', '2', '1', 'Vocational counseling', 'Organizations that administer tests which measure the skills, abilities and interests of job seekers and help them make appropriate decisions regarding an occupational field or position.', 'Yes'),
(237, 'J', '2', '2', 'Job training', 'Organizations that train people in the specific skills they will need to obtain employment in a particular industry or which provide work experience for youth or others who have no employment history.', 'Yes'),
(238, 'J', '3', '', 'Vocational rehabilitation', 'Organizations that provide job training and employment experiences for individuals with disabilities, people who have been disabled by use of drugs or alcohol or people with emotional difficulties, with the objective of helping them to become economically self-sufficient.', 'Yes'),
(239, 'J', '3', '2', 'Goodwill industries', 'Goodwill industries sites.', 'Yes'),
(240, 'J', '3', '3', 'Sheltered employment', 'Organizations that provide paid employment opportunities in a controlled, protected environment for people with disabilities who are unable to obtain competitive employment. also included are work activity centers which provide personal and social development opportunities for participants who have demonstrated inconsequential production capacity.', 'Yes'),
(241, 'J', '4', '', 'Labor unions', 'Organizations that work to promote the rights of employees to fair remuneration and safe working conditions \\[note: these are generally section 501(c)(5) organizations\\].', 'Yes'),
(242, 'J', '9', '9', 'Employment n.e.c.', 'Use this code for organizations that clearly provide employment and job related services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(243, 'K', '', '', 'Food, agriculture & nutrition', 'Na', 'Yes'),
(244, 'K', '0', '', 'Support services for food, agriculture & nutrition', '', 'Yes'),
(245, 'K', '1', '1', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a fund-raising entity for a single institution within the food, agriculture & nutrition major group area.', 'Yes'),
(246, 'K', '1', '9', 'General support services for food, agriculture & n', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the food, agriculture and nutrition major group area.', 'Yes'),
(247, 'K', '2', '', 'Agricultural programs', 'Organizations that focus on the development and improvement of food resources or food procurement through information and technical assistance for agricultural establishments and individuals in rural or urban settings. use this code for organizations that provide a wide range of agricultural services or those that offer services to support the agricultural sector not specified below.', 'Yes'),
(248, 'K', '2', '5', 'Farmland preservation', 'Organizations such as land trusts that work to ensure that farmland is preserved for farming purposes rather than freed for development or environmental quality purposes.', 'Yes'),
(249, 'K', '2', '6', 'Animal husbandry', 'Organizations that provide information, technical assistance and support for individuals or commercial establishments that are engaged in the keeping, grazing, feeding and/or sale of livestock. \\[note: these organizations are typically found in section 501(c)(5).\\]', 'Yes'),
(250, 'K', '2', '8', 'Farm bureaus & granges', 'Organizations whose members are farmers or ranchers who have affiliated for the purpose of representing the interests of agricultural producers and rural communities. \\[note: these organizations are typically found in section 501(c)(5).\\]', 'Yes'),
(251, 'K', '2', 'A', 'Other vegetable (except potato) and melon farming', 'Null', 'Yes'),
(252, 'K', '2', 'B', 'SoilÂ preparation,Â planting,Â andÂ cultivating', 'Null', 'Yes'),
(253, 'K', '2', 'C', 'Wineries', 'Null', 'Yes'),
(254, 'K', '3', '', 'Food programs', 'Organizations that provide access to free or low-cost food products to children, seniors, or indigents by distributing groceries, providing meals, providing facilities for storing food or making available land on which people can grow their own produce. use this code for organizations that provide a wide range of food services or those that offer food-related services not specified below.', 'Yes'),
(255, 'K', '3', '1', 'Food banks & pantries', 'Organizations that gather, store and distribute food to indigents at no charge or at low cost.', 'Yes'),
(256, 'K', '3', '4', 'Congregate meals', 'Organizations (also known as nutrition sites or senior nutrition programs) that provide hot meals on a regular basis, usually for elderly individuals but also for disabled adults or other target populations.', 'Yes'),
(257, 'K', '3', '5', 'Soup kitchens', 'Organizations that provide meals in a central location for indigent people.', 'Yes'),
(258, 'K', '3', '6', 'Meals on wheels', 'Organizations that prepare and deliver regular hot meals to elderly individuals, people with disabilities or people with aids or other targeted conditions who are unable to shop and/or prepare food for themselves or to travel to a site where a meal is being served. also known as home delivered meals.', 'Yes'),
(259, 'K', '4', '', 'Nutrition', 'Organizations that provide information concerning the basic principles of healthful eating, food handling, food preparation and shopping skills. included is information about the basic food groups, vitamin and mineral requirements, and the relationship of nutrition to the preservation of good health and the prevention of illness.', 'Yes'),
(260, 'K', '5', '', 'Home economics', 'Organizations that provide instruction that deals with the basic activities of homemaking including caring for and managing children, shopping for and preparing nutritious meals, maintaining a clean and safe living environment, and other in-home responsibilities.', 'Yes'),
(261, 'K', '6', 'A', 'Meat markets', 'Null', 'Yes'),
(262, 'K', '6', 'B', 'Confectionery and nut stores', 'Null', 'Yes'),
(263, 'K', '6', 'C', 'Caterers', 'Null', 'Yes'),
(264, 'K', '6', 'D', 'Mobile food services', 'Null', 'Yes'),
(265, 'K', '6', 'E', 'Drinking places (alcoholic beverages)', 'Null', 'Yes'),
(266, 'K', '6', 'F', 'Snack and nonalcoholic beverage bars', 'Null', 'Yes'),
(267, 'K', '9', '', 'Limited-service restaurants', 'This u.s. industry comprises establishments primarily engaged in providing food services (except snack and nonalcoholic beverage bars) where patrons generally order or select items and pay before eating. food and drink may be consumed on premises, taken out, or delivered to the customer\'s location. some establishments in this industry may provide these food services in combination with selling alcoholic beverages.', 'Yes'),
(268, 'K', '9', '1', 'Supermarkets and other grocery (except convenience', 'This industry comprises establishments generally known as supermarkets and grocery stores primarily engaged in retailing a general line of food, such as canned and frozen foods; fresh fruits and vegetables; and fresh and prepared meats, fish, and poultry. included in this industry are delicatessen-type establishments primarily engaged in retailing a general line of food.', 'Yes'),
(269, 'K', '9', '2', 'Convenience stores', 'This industry comprises establishments known as convenience stores or food marts (except those with fuel pumps) primarily engaged in retailing a limited line of goods that generally includes milk, bread, soda, and snacks.', 'Yes'),
(270, 'K', '9', '3', 'Fruit and vegetable markets', 'This industry comprises establishments primarily engaged in retailing fresh fruits and vegetables.', 'Yes'),
(271, 'K', '9', '4', 'All other specialty food stores', 'This u.s. industry comprises establishments primarily engaged in retailing miscellaneous specialty foods (except meat, fish, seafood, fruit and vegetables, confections, nuts, popcorn, and baked goods) not for immediate consumption and not made on the premises.', 'Yes'),
(272, 'K', '9', '5', 'Food (health) supplement stores', 'This u.s. industry comprises establishments primarily engaged in retailing food supplement products, such as vitamins, nutrition supplements, and body enhancing supplements.', 'Yes'),
(273, 'K', '9', '6', 'Warehouse clubs and supercenters', 'This industry comprises establishments known as warehouse clubs, superstores or supercenters primarily engaged in retailing a general line of groceries in combination with general lines of new merchandise, such as apparel, furniture, and appliances.', 'Yes'),
(274, 'K', '9', '7', 'Food service contractors', 'This industry comprises establishments primarily engaged in providing food services at institutional, governmental, commercial, or industrial locations of others based on contractual arrangements with these type of organizations for a specified period of time. the establishments of this industry provide food services for the convenience of the contracting organization or the contracting organization\'s customers. the contractual arrangement of these establishments with contracting organizations may vary from type of facility operated (e.g., cafeteria, restaurant, fast-food eating place), revenue sharing, cost structure, to providing personnel. management staff is always provided by the food service contractors.', 'Yes'),
(275, 'K', '9', '8', 'Full-service restaurants', 'This u.s. industry comprises establishments primarily engaged in providing food services to patrons who order and are served while seated (i.e., waiter/waitress service) and pay after eating. these establishments may provide this type of food service to patrons in combination with selling alcoholic beverages, providing carryout services, or presenting live nontheatrical entertainment.', 'Yes'),
(276, 'K', '9', '9', 'Food, agriculture & nutrition n.e.c.', 'Use this code for organizations that clearly provide food, agriculture or nutrition services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(277, 'L', '', '', 'Housing & shelter', 'Na', 'Yes'),
(278, 'L', '0', '', 'Support services for housing & shelter related ser', '', 'Yes'),
(279, 'L', '1', '', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a fund-raising entity for a single institution within the housing & shelter major group area.', 'Yes'),
(280, 'L', '1', '9', 'General support services for housing and shelter r', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the housing, shelter major group area.', 'Yes'),
(281, 'L', '2', '', 'Housing development, construction & management', 'Organizations that build, rehabilitate, manage and/or provide rental housing for low-income individuals and families, older adults and people with disabilities; or which make purchasable housing available to low or moderate income families by offering lower priced housing and/or affordable payment plans, by arranging for interest or mortgage subsidies or by involving eventual owners in the construction process (sweat equity). use this code for organizations that provide housing services for a wide range of individuals or for those that offer housing options for low income tenants that are not specified below.', 'Yes'),
(282, 'L', '2', '1', 'Low-income & subsidized rental housing', 'Organizations that develop, rehabilitate, manage and/or provide rental housing that is available to people who qualify on the basis of income, age or disability for publicly subsidized housing e.g., hud housing or housing assistance under section 8 of the housing and urban development act.', 'Yes'),
(283, 'L', '2', '2', 'Senior citizens housing & retirement communities', 'Residential options exclusively for older adults who want to have a simpler, maintenance-free lifestyle and enjoy the company of peers with common interests, or who require a moderate amount of support in the activities of daily living to maintain independent living.', 'Yes'),
(284, 'L', '2', '4', 'Independent housing for people with disabilities', 'Organizations that develop, manage and/or provide rental housing with the availability of supportive services for individuals with disabilities.', 'Yes'),
(285, 'L', '2', '5', 'Housing rehabilitation', 'Organizations that clear slums and renew or rehabilitate old housing and other structures including abandoned buildings in blighted and depressed residential neighborhoods in order to provide a safe, sanitary and pleasant place for people to live.', 'Yes'),
(286, 'L', '3', '', 'Housing search assistance', 'Organizations that assist people to find available purchasable or rental housing which meets their individual needs.', 'Yes'),
(287, 'L', '4', '', 'Temporary housing', 'Organizations that provide a temporary place to stay for newcomers, travelers, people who are in crisis, or homeless individuals in the community.', 'Yes'),
(288, 'L', '4', '1', 'Homeless shelters', 'Organizations that provide a temporary place to stay for people who have no permanent housing.', 'Yes'),
(289, 'L', '4', 'A', 'Hotels (except casino hotels) and motels', 'Null', 'Yes'),
(290, 'L', '4', 'B', 'Bed-and-breakfast inns', 'Null', 'Yes'),
(291, 'L', '5', '', 'Homeowners & tenants associations', 'Organizations that serve the interests of the community as a whole and provide services which meet the needs of people who own or rent apartments, condominiums, townhomes, mobile home parks or other housing complexes who are their members. also included are complexes that are owned collectively by the people who live there.', 'Yes'),
(292, 'L', '8', '', 'Housing support', 'Organizations that provide supportive services which help people obtain and remain in suitable housing. use this code for organizations that provide multiple supportive services or for supportive services specified below.', 'Yes'),
(293, 'L', '8', '1', 'Home improvement & repairs', 'Organizations that provide assistance for homeowners who need to upgrade their homes to make them attractive, safe, accessible and energy efficient.', 'Yes'),
(294, 'L', '8', '2', 'Housing expense reduction support', 'Organizations that provide home purchase or construction loans; finance new living accommodations; or pay current housing and/or utility bills for people who cannot afford to make the payments themselves and who qualify for this service on the basis of need or income.', 'Yes'),
(295, 'L', '9', '9', 'Housing & shelter n.e.c.', 'Use this code for organizations that clearly provide housing or shelter services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(296, 'M', '', '', 'Public safety, disaster preparedness & relief', 'Na', 'Yes'),
(297, 'M', '0', '', 'Support services for public safety, disaster prepa', '', 'Yes'),
(298, 'M', '1', '', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a fund-raising entity for a single institution within the public safety, disaster preparedness & relief major group area.', 'Yes'),
(299, 'M', '1', '3', 'General support services for public safety, disast', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the public safety, disaster preparedness, and relief major group area.', 'Yes'),
(300, 'M', '4', '', 'Safety education', 'Organizations that make the public aware of the measures that people can take to reduce the risk of accidents. use this code for general safety programs or those that deal with a specific safety education issue not specified below.', 'Yes'),
(301, 'M', '4', '1', 'First aid', 'Organizations that provide instruction in the basic lifesaving techniques that are used in the administration of emergency assistance to individuals who have been injured prior to the arrival of trained medical personnel. includes cpr instruction and instruction in techniques for relieving an individual who is choking.', 'Yes'),
(302, 'M', '4', '2', 'Automotive safety', 'Organizations that make the public aware of the measures people can take to ensure their own safety and that of others while driving or riding as passengers in a motor vehicle, riding a bicycle, roller skating, skateboarding or walking as pedestrians in traffic.', 'Yes'),
(303, 'M', '6', '', 'Public safety benevolent associations', 'Organizations whose primary purpose is to support the needs of public safety agencies and their personnel.', 'Yes'),
(304, 'M', '9', '9', 'Public safety, disaster preparedness & relief n.e.', 'Use this code for organizations that clearly provide public safety or disaster services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(305, 'N', '', '', 'Recreation & sports', 'Na', 'Yes'),
(306, 'N', '0', '', 'Support services for recreation & sports related s', '', 'Yes'),
(307, 'N', '1', '', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a fund-raising entity for a single institution within the recreation & sports major group area.', 'Yes'),
(308, 'N', '1', '9', 'General support services for recreation & sportsre', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the recreation, sports, leisure, athletics major group area.', 'Yes'),
(309, 'N', '2', '', 'Camps', 'Organizations that operate facilities for cooperative group living experiences in the out-of-doors; and which provide opportunities to learn campcraft, nature lore and conservation, and participate in a wide range of indoor and outdoor recreational, athletic and group social activities including cookouts.', 'Yes'),
(310, 'N', '2', 'A', 'Rv (recreational vehicle) parks and campgrounds', 'Null', 'Yes'),
(311, 'N', '2', 'B', 'Recreational and vacation camps (except campground', 'Null', 'Yes'),
(312, 'N', '3', '', 'Physical fitness & community recreational faciliti', 'Organizations that provide acreage and facilities for a broad range of recreational and fitness activities, sports and games. use this code for recreational facilities available to the general public and for recreational programs not specified below.', 'Yes'),
(313, 'N', '3', '1', 'Community recreational centers', 'Organizations that operate centers which offer, at a single location, a variety of recreational facilities such as athletic fields and courts, a gymnasium, a swimming pool and public lockers. recreational centers usually offer an organized program of activities for community residents and provide all necessary equipment.', 'Yes'),
(314, 'N', '3', '2', 'Parks & playgrounds', 'Organizations that develop, maintain and make available to the general public recreational areas which are equipped with athletic fields and courts, campgrounds, picnic areas and a variety of recreational trails such as bridle trails, hiking trails, off-the-road vehicle trails and snowmobile trails.', 'Yes'),
(315, 'N', '4', '', 'Sports associations & training facilities', 'Organizations such as intercollegiate athletic associations that promote athletic competition among member schools. also includes separately organized private educational institutions that provide instruction in a particular sport or recreational activity.', 'Yes'),
(316, 'N', '5', '', 'Recreational clubs', 'Organizations that make available to members and their guests and facilities for recreational activities, sports and games. also included are social clubs that provide opportunities for people to meet and socialize with their peers at dances, parties, picnics, barbecues and other companionable events; and special interest clubs which enable people to share hobbies or other interests with individuals with those same interests. \\[many of these are 501(c)(7) organizations.\\]', 'Yes'),
(317, 'N', '5', '2', 'Fairs', 'Organizations that sponsor, organize and promote fairs and festivals. includes collectible/antique fairs, county and state fairs, street fairs, festivals, parades, and other similar activities during religious and patriotic holidays and other special occasions.', 'Yes'),
(318, 'N', '6', '', 'Amateur sports', 'Organizations that provide opportunities for people of all ages to learn, become competitive in and enjoy the organized recreational activity, sport or game of their choice. these programs may be offered by local clubs devoted to a particular activity or sport; may provide individual or team coaching assistance or instruction, access to equipment and facilities, and uniforms, if necessary; and may sponsor or make arrangements for athletes to participate in amateur competitions, usually at the local or regional level, and provide officials for games. these events are generally for the enjoyment of the athletes and are not at a high enough competitive level to be considered spectator sports.', 'Yes'),
(319, 'N', '6', '1', 'Fishing & hunting', 'Organizations that provide opportunities for people to learn and become competitive in archery; fly or bait fishing; game bird, game fowl, or game animal hunting; fox hunting; and/or the use of firearms on the target range.', 'Yes'),
(320, 'N', '6', '2', 'Basketball', 'Organizations that provide opportunities for people to learn and become competitive in basketball. basketball equipment, uniforms, and officials for competitions are generally included.', 'Yes'),
(321, 'N', '6', '3', 'Baseball & softball', 'Organizations such as little leagues that provide opportunities for people to learn and become competitive in baseball or softball. coaching, access to a baseball field, baseball equipment, uniforms, and managers and umpires for games are generally included.', 'Yes'),
(322, 'N', '6', '4', 'Soccer', 'Organizations that provide opportunities for people to learn and become competitive in soccer. coaching, access to a soccer field, soccer equipment, uniforms, and officials for competitions are generally included.', 'Yes'),
(323, 'N', '6', '5', 'Football', 'Organizations that provide opportunities for people to learn and become competitive in football. coaching, access to a football field, football equipment, uniforms, and referees for competitions are generally included.', 'Yes'),
(324, 'N', '6', '6', 'Racquet sports', 'Organizations that provide opportunities for people to learn and become competitive in tennis, badminton, racquet ball, squash, table tennis and other racquet sports. coaching, access to courts, equipment and officials for competitions are generally included.', 'Yes'),
(325, 'N', '6', '7', 'Swimming & other water recreation', 'Organizations that provide opportunities for people to learn and become competitive in swimming, diving, snorkeling, surfing, water skiing, water polo, boating, white water rafting and other water sports. coaching, access to a swimming pool or other facilities, sports equipment, and officials for competitions are generally included.', 'Yes'),
(326, 'N', '6', '8', 'Winter sports', 'Organizations that provide opportunities for people to learn and become competitive in ice hockey, ice skating, alpine and cross-country skiing, sledding/tobogganing and other winter sports. coaching; access to skating rinks, ski slopes or other facilities; sports equipment; and officials for competitions are generally included.', 'Yes'),
(327, 'N', '6', '9', 'Equestrian', 'Organizations that provide opportunities for people to learn and become competitive in sports involving horseback riding and jumping. coaching, access to riding and jumping facilities and officials for competitions are generally included.', 'Yes'),
(328, 'N', '6', 'A', 'Golf', 'Organizations including public golf courses that provide opportunities for people to learn and become competitive in the game of golf. coaching, access to a golf course, golf equipment, and officials for competitions are generally included.', 'Yes'),
(329, 'N', '7', '', 'Amateur sports competitions', 'Organizations that sponsor sports competitions for amateurs at the national, state, or international level or competitions at multiple levels including the international level.', 'Yes'),
(330, 'N', '7', '1', 'Olympics', 'Organizations that prepare amateur athletes to participate in the olympics, an international program of sports training and athletic competition which features a variety of sports and games, or in other similar competitions. included are the national governing bodies for sports that are part of the olympic and pan-american games whose charge is to select, train and manage athletes who represent the u.s. internationally.', 'Yes'),
(331, 'N', '7', '2', 'Special olympics', 'Organizations that prepare people to participate in the special olympics, an international program of sports training and athletic competition for children and adults with disabilities which features a variety of sports and games, or in other similar competitions.', 'Yes'),
(332, 'N', '8', '', 'Professional athletic leagues', 'Membership organizations that are engaged in promoting the interests of individuals who are active or who have retired from professional sports.', 'Yes'),
(333, 'N', '9', '9', 'Recreation & sports n.e.c.', 'Use this code for organizations that clearly provide recreation, sports, leisure or athletics services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(334, 'O', '', '', 'Youth development', 'Na', 'Yes'),
(335, 'O', '0', '', 'Support services for youth development related ser', '', 'Yes'),
(336, 'O', '1', '', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a fund-raising entity for a single institution within the youth development major group area.', 'Yes'),
(337, 'O', '1', '9', 'General support services for youth development rel', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the youth development major group area.', 'Yes'),
(338, 'O', '2', '', 'Youth centers & clubs', 'Organizations that provide supervised recreational and social activities for children and youth of all ages and backgrounds, but particularly for disadvantaged youth, through youth-oriented clubs or centers with the objective of building character and developing leadership and social skills among participants. use this code for teen centers and clubs other than boys clubs, girls clubs or boys and girls clubs, e.g., police athletic leagues.', 'Yes'),
(339, 'O', '2', '1', 'Boys clubs', 'Organizations specifically designated as boys clubs that provide a wide range of supervised activities and delinquency prevention services for children and youth of all ages and backgrounds, but particularly for disadvantaged youth, with the objective of building character and developing leadership and social skills among participants.', 'Yes'),
(340, 'O', '2', '2', 'Girls clubs', 'Organizations specifically designated as girls clubs that provide a wide range of supervised activities and delinquency prevention services for children and youth of all ages and backgrounds, but particularly for disadvantaged youth, with the objective of building character and developing leadership and social skills among participants.', 'Yes'),
(341, 'O', '2', '3', 'Boys & girls clubs', 'Organizations specifically designated as boys and girls clubs that provide a wide range of supervised activities and delinquency prevention services for children and youth of all ages and backgrounds, but particularly for disadvantaged youth, with the objective of building character and developing leadership and social skills among participants.', 'Yes'),
(342, 'O', '3', '', 'Adult & child matching programs', 'Programs, also known as adult/child mentoring programs, that provide male or female adult companionship, guidance and/or role models for young men or women. use this code for all adult, child matching programs other than big brothers or big sisters.', 'Yes'),
(343, 'O', '3', '1', 'Big brothers & big sisters', 'Organizations specifically designated as big brothers or big sisters that provide male or female adult companionship, guidance and/or role models for young men or women.', 'Yes'),
(344, 'O', '4', '', 'Scouting', 'Programs that provide opportunities for children and youth to develop individual and group initiative and responsibility, self-reliance, courage, personal fitness, discipline and other desirable qualities of character through participation in a wide range of organized recreational, educational and civic activities under the leadership of qualified adult volunteers. use this code for troop type organizations not specifically designated as boy scouts of america, girl scouts of the u.s.a or camp fire.', 'Yes'),
(345, 'O', '4', '1', 'Boy scouts of america', 'Organizations specifically designated as boy scouts of america troops and councils.', 'Yes'),
(346, 'O', '4', '2', 'Girl scouts of the u.s.a.', 'Organizations specifically designated as girl scouts of the u.s.a. troops and councils.', 'Yes'),
(347, 'O', '4', '3', 'Camp fire', 'Organizations specifically designated as camp fire programs.', 'Yes'),
(348, 'O', '5', '', 'Youth development programs', 'Programs that provide opportunities for children and youth to participate in recreational, cultural, social and civic activities through membership in clubs and other youth groups with a special focus whose purpose is to help youngsters develop their potential and grow into healthy, educated, responsible and productive adults. use this code for youth development programs not specified below.', 'Yes'),
(349, 'O', '5', '1', 'Youth community service clubs', 'Organizations like key club that provide opportunities for children and youth to make a contribution to their local community through volunteer service projects. the purpose of the organization is to develop leadership skills and good citizenship practices in youngsters who are interested in service to others.', 'Yes'),
(350, 'O', '5', '2', 'Youth development - agricultural', 'Organizations like 4-h club, and future homemakers that emphasize the total development of young people through work on animal, engineering, family/consumer health, resource, plant or social science projects in consultation with their parents and supervising adult volunteers. members also participate in camping activities, leadership conferences, awards programs and community service activities.', 'Yes'),
(351, 'O', '5', '3', 'Youth development - business', 'Organizations like junior achievement that utilize volunteers from the teaching profession, business and industry to provide firsthand information about the business world for children and youth. some clubs may also initiate small business ventures under the guidance of adult volunteers.', 'Yes'),
(352, 'O', '5', '4', 'Youth development - citizenship', 'Organizations like youth republic and girls nation that provide opportunities for young people to gain a clear understanding of the process of government and to develop an appreciation for their approaching citizenship responsibilities.', 'Yes'),
(353, 'O', '5', '5', 'Youth development - religious leadership', 'Organizations like youth for christ, campus crusade for christ and liberal religious youth that provide a variety of recreational and social activities for young people with the objective of strengthening their religious values and meeting their spiritual needs as well as supporting their growth and development as individuals.', 'Yes'),
(354, 'O', '9', '9', 'Youth development n.e.c.', 'Use this code for organizations that clearly provide youth development services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(355, 'P', '', '', 'Human services', 'Na', 'Yes'),
(356, 'P', '0', '', 'Support services for human servicesrelated service', '', 'Yes'),
(357, 'P', '1', '', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a fund-raising entity for a single institution within the human services major group area.', 'Yes'),
(358, 'P', '1', '9', 'General support services for human services relate', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the human services - multipurpose and other major group area.', 'Yes'),
(359, 'P', '2', '', 'Human service organizations', 'Organizations that provide a broad range of social services for individuals or families. use this code for multiservice organizations such as lutheran social services, catholic social services and other community service organizations not specified below that provide a variety of services from throughout the p section or services from the p section in combination with services described in other sections (e.g., an organization that provides family counseling, substance abuse services, employment assistance and services for at - risk youth).', 'Yes'),
(360, 'P', '2', '1', 'American red cross', 'Separately incorporated, local chapters of the american red cross.', 'Yes'),
(361, 'P', '2', '2', 'Urban league', 'Separately incorporated, local urban league sites.', 'Yes'),
(362, 'P', '2', '4', 'Salvation army', 'Separately incorporated, local salvation army sites.', 'Yes'),
(363, 'P', '2', '6', 'Volunteers of america', 'Separately incorporated, local volunteers of america sites.', 'Yes'),
(364, 'P', '2', '7', 'Young mens or womens associations', 'Separately incorporated, local ymca, ywca, ymha, ywha sites.', 'Yes'),
(365, 'P', '2', '8', 'Neighborhood centers', 'Neighborhood-based multipurpose centers that offer, at a single location, a wide variety of services and activities that are structured to meet the needs of the entire community through different programs for different age and interest groups.', 'Yes'),
(366, 'P', '2', '9', 'Thrift shops', 'Organizations that offer new or second-hand furniture, appliances, clothing, toys and other material goods at lower than retail prices, and which often use the proceeds from sales to support other services to the community. thrift shops accept direct donations from the public of new and reusable goods.', 'Yes'),
(367, 'P', '3', '', 'Children & youth services', 'Organizations that provide a wide variety of informational, social and supportive services for children and youth including runaways and other troubled youth. use this code for organizations that provide services for children and/or youth that are not specified below.', 'Yes'),
(368, 'P', '3', '1', 'Adoption', 'Organizations that arrange permanent homes under new legal parentage for individuals whose birth parents are unable or unwilling to provide for their care.', 'Yes'),
(369, 'P', '3', '2', 'Foster care', 'Organizations that provide an alternative family living arrangement in agency-supervised family homes for dependent children who have been removed from their homes because of abuse, neglect or abandonment; or for children or adults with disabilities who are unable to live with their birth families or in an independent setting.', 'Yes'),
(370, 'P', '3', '3', 'Child day care', 'Organizations that provide substitute parental care for children during some portion of a twenty-four hour day.', 'Yes'),
(371, 'P', '4', '', 'Family services', 'Organizations that provide a wide variety of social services that are designed to support healthy family development, improve the familys ability to resolve problems and prevent the need for unnecessary placement of children in settings outside the home. use this code for organizations that provide comprehensive family support services or which offer services other than those specified below.', 'Yes'),
(372, 'P', '4', '2', 'Single parent agencies', 'Organizations like parents without partners that provide supportive services for single parents.', 'Yes'),
(373, 'P', '4', '3', 'Family violence shelters', 'Organizations that provide temporary shelter for women who have experienced domestic violence and for their children.', 'Yes'),
(374, 'P', '4', '4', 'In-home assistance', 'Organizations that provide assistance in performing routine household, yard and personal care activities for frail elderly, disabled or indigent individuals or families whose normal routines have been disrupted by an emergency.', 'Yes'),
(375, 'P', '4', '5', 'Family services for adolescent parents', 'Organizations that provide pregnancy counseling, maternity home care and other supportive services for pregnant adolescents or adolescents who are parents.', 'Yes'),
(376, 'P', '4', '6', 'Family counseling', 'Organizations that offer therapeutic sessions which focus on the system of relationships and communication patterns among family members and which attempt to modify those relationships and patterns to achieve greater harmony. the therapist focuses on the family as a unit rather than concentrating on one of the members who is singled out as the one in need of treatment.', 'Yes'),
(377, 'P', '4', '7', 'Pregnancy centers', 'Organizations that provide free and confidential services to women and families facing unplanned pregnancies. services can include pregnancy testing and physician exams with ultrasound, counseling on pregnancy-related issues, information on stds, healthcare & community referrals, and help with material goods such as maternity and baby items.', 'Yes'),
(378, 'P', '5', '', 'Personal social services', 'Organizations that provide a variety of personal social services or which offer personal social services not specified below.', 'Yes'),
(379, 'P', '5', '1', 'Financial counseling', 'Organizations that provide advice and guidance for people who need assistance in obtaining credit, obtaining or correcting information in their credit records, reducing their debt burden or managing their financial resources more effectively.', 'Yes'),
(380, 'P', '5', '2', 'Transportation assistance', 'Organizations that provide or coordinate free or low-cost transportation services for older adults, people with disabilities, people with medical conditions, people who are indigent, students and other eligible individuals.', 'Yes'),
(381, 'P', '5', '3', 'Gift distribution', 'Organizations - like toys for tots - that provide, coordinate or raise money and donations for holiday assistance and gift distribution programs, usually but not exclusively organized around holidays.', 'Yes'),
(382, 'P', '6', '', 'Emergency assistance', 'Organizations that provide food, clothing, household goods, cash and other forms of short-term emergency assistance for indigent individuals and families who have insufficient resources to meet their basic needs.', 'Yes');
INSERT INTO `i2D_D_Category` (`i2D_D_CATEGORY_ID`, `i2D_D_CATEGORY_CODE`, `i2D_D_SUB_CATEGORY_CODE`, `i2D_D_CHILD_CATEGORY_CODE`, `i2D_D_CATEGORY_NAME`, `i2D_D_CATEGORY_DESCIPTION`, `i2D_D_ACTIVE`) VALUES
(383, 'P', '6', '1', 'Travelers aid', 'Organizations that provide supportive services including information and emergency assistance for tourists, travelers or other visitors who are stranded or have encountered other problems.', 'Yes'),
(384, 'P', '6', '2', 'Victims services', 'Organizations that provide supportive services for crime victims which may include crisis counseling, medical services, escort services, transportation, child care, financial assistance, protective services, information about the mechanics of court proceedings, assistance with forms to file for reimbursement of crime-related expenses or losses, and/or advice and guidance concerning court appearances.', 'Yes'),
(385, 'P', '7', '', 'Residential care & adult day programs', 'Organizations that provide alternative living arrangements for people who require care, supervision and support on a 24-hour basis or during part of the day. use this code for organizations that provide residential, custodial care, but the specific nature of the facility is unclear, or which have multiple facilities which fall into more than one category below.', 'Yes'),
(386, 'P', '7', '1', 'Adult day care', 'Organizations that provide personal care for dependent adults or adults with disabilities in a supervised group setting during some portion of a twenty-four hour day. services may include social and recreational activities, training that is essential for sustaining the activities of daily living and meals, as appropriate.', 'Yes'),
(387, 'P', '7', '3', 'Group homes', 'Facilities, usually located in residential neighborhoods, that provide 24-hour non-medical care for individuals with disabilities who need supervision and/or assistance with activities of daily living.', 'Yes'),
(388, 'P', '7', '4', 'Hospices', 'Organizations that provide palliative and supportive services including medical care, pain and symptom management, home nurse visitation, case management, counseling, and bereavement services for terminally ill people who are in the final stages of their illnesses and for members of their families.', 'Yes'),
(389, 'P', '7', '5', 'Supportive housing for older adults', 'Residential facilities for older adults who are unable to function in an independent living environment because they need assistance with toileting, bathing, dressing, medication, meals and housekeeping and other activities of daily living, but do not require nursing care on a regular basis.', 'Yes'),
(390, 'P', '7', '6', 'Homes for children & adolescents', 'Organizations that provide alternative living arrangements for children and young adults who require care, supervision and support on a 24-hour basis or during part of the day. use also for children and youth who have been neglected or abandoned and would benefit from a professionally supervised, structured group environment.', 'Yes'),
(391, 'P', '7', 'A', 'Residential intellectual and developmental disabil', 'Null', 'Yes'),
(392, 'P', '8', '', 'Centers to support the independence of specific po', 'Organizations that provide multipurpose centers or services that meet the needs and interests of a particular target population. use this code for centers or services for special populations not specified below or for facilities that serve multiple special populations.', 'Yes'),
(393, 'P', '8', '1', 'Senior centers', 'Organizations that provide or coordinate a wide variety of programs and services that meet the needs and interests of the senior population. also included are organizations that administer funding for senior services under title iii of the older americans act.', 'Yes'),
(394, 'P', '8', '2', 'Developmentally disabled centers', 'Organizations such as retarded citizens associations that provide or coordinate a wide variety of programs and services for people with developmental disabilities.', 'Yes'),
(395, 'P', '8', '3', 'Women\'s centers', 'Organizations that provide or coordinate a wide variety of programs and services that are needed by and of interest to this population.', 'Yes'),
(396, 'P', '8', '4', 'Ethnic & immigrant centers', 'Organizations that provide or coordinate a wide variety of programs and services that are structured to meet the social, educational, economic, recreational and other needs of specific ethnic and/or immigrant groups in ways that are culturally appropriate.', 'Yes'),
(397, 'P', '8', '5', 'Homeless centers', 'Organizations that provide supportive services for individuals and families who are homeless or which work with people who are at risk for homelessness in an effort to prevent them from losing their permanent residence.', 'Yes'),
(398, 'P', '8', '6', 'Blind & visually impaired centers', 'Organizations that provide or coordinate a wide variety of programs and services for people who are blind or have visual impairments.', 'Yes'),
(399, 'P', '8', '7', 'Deaf & hearing impaired centers', 'Organizations that provide or coordinate a wide variety of programs and services for people who are deaf or have hearing impairments.', 'Yes'),
(400, 'P', '8', '8', 'Lgbt centers', 'Organizations that provide or coordinate a wide variety of programs and services that meet the needs and interests of people who are lesbian, gay, bisexual, or transgenedered.', 'Yes'),
(401, 'P', '9', '9', 'Human services n.e.c.', 'Use this code for organizations that clearly provide human services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(402, 'Q', '', '', 'International, foreign affairs & national security', 'Private nonprofit organizations whose primary purpose is to provide services or other forms of support to increase mutual understanding across countries, encourage social, economic or political development outside of the u.s., and/or impact national, multilateral or international policies on international issues. (rev. 12/04)', 'Yes'),
(403, 'Q', '0', '', 'Support services for international, foreign affair', '', 'Yes'),
(404, 'Q', '1', '', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a fund-raising entity for a single institution within the international, foreign affairs & national security major group area.', 'Yes'),
(405, 'Q', '1', '9', 'General support services for international, foreig', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the international, foreign affairs and national security major group area.', 'Yes'),
(406, 'Q', '2', '', 'Promotion of international understanding', 'Organizations whose primary purpose is to promote international understanding through activities, such as events, forums, trainings, and exchanges, which enable people to develop an appreciation for other societies, their traditions and culture. use this code for organizations that provide a wide variety of organizations relating to the promotion of international understanding or which offer specific programs not specified below.', 'Yes'),
(407, 'Q', '2', '1', 'International cultural exchange', 'Organizations whose primary purpose is to provide international cultural educational experiences abroad and/or sponsor international cultural events (e.g., touring performing arts troupes) that are designed to increase understanding of other societies through the arts and humanities.\" also use this code for financial support for museums and other cultural institutions outside of the united states.', 'Yes'),
(408, 'Q', '2', '2', 'International academic exchange', 'Organizations that provide opportunities for high school students from foreign countries to live with an approved family in the united states and attend an american high school for one semester or one year in exchange for american students living and attending school in their country during the same period of time.', 'Yes'),
(409, 'Q', '2', '3', 'International exchange n.e.c.', 'Organizations whose primary purpose is to provide international living experiences for individuals and families by arranging job exchanges, residence exchanges and other similar opportunities.', 'Yes'),
(410, 'Q', '3', '', 'International development', 'Organizations whose primary purpose is to provide technical assistance training and material resources to support the capacity-building efforts of nations outside the u. s. with a focus on agricultural and rural development, health, education, social welfare, small business development and industrial growth. use this code for organizations that provide a wide range of international development and/or relief services or those not specified below.', 'Yes'),
(411, 'Q', '3', '1', 'International agricultural development', 'Organizations that provide information, technical assistance and support to developing countries regarding the planting, nurturing, protection and utilization of agricultural products with the objective of increasing the productivity of their cultivated land and improving their food supply.', 'Yes'),
(412, 'Q', '3', '2', 'International economic development', 'Organizations that provide technical assistance and training, loans and loan guarantees and other forms of support to stimulate the economy, expand employment opportunities, encourage the establishment and growth of commerce and industry and otherwise enhance the economic development of countries outside the united states.', 'Yes'),
(413, 'Q', '3', '3', 'International relief', 'Organizations that work to relieve poverty in developing countries by providing funds, technical assistance and supplies which improve the health, education, welfare, social well-being and self-reliance of individuals and families. also included are organizations that provide relief services in response to a major disaster or large-scale emergency that occurs abroad.', 'Yes'),
(414, 'Q', '3', '4', 'International educational development <i>(draft co', 'Organizations whose primary purpose is to educate individuals, provide financial support for educational institutions and other forms of material support for students and institutions in countries outside the united states.', 'Yes'),
(415, 'Q', '3', '5', 'International democracy & civil society developmen', 'Organizations whose primary purpose is to carry out programs that support the development of democracy and civil society in countries outside of the united states. includes organizations that provide assistance in election planning and administration, election law development, political party development, constitutional development, and voter and civic education, which may include training of government and civic leaders. also includes organizations that promote a supportive legal and regulatory environment for civil society and otherwise strengthen civil society actors and organizations as a group.', 'Yes'),
(416, 'Q', '3', '6', 'International science & technology development <i>', 'Organizations whose primary purpose is to provide technical assistance, training, and other forms of support to encourage the development of appropriate technologies, science and technology transfer, and technological capability building of countries outside the united states.', 'Yes'),
(417, 'Q', '3', '8', 'International environment, population & sustainabi', 'Organizations whose primary purpose is to protect the environment and create a sustainable world by addressing issues such as cross national concerns and advocacy and research on environmental and population policy.', 'Yes'),
(418, 'Q', '3', '9', 'International health development <i>(draft code - ', 'Organizations whose primary purpose is to provide health assistance and training, loans and loan guarantees, financial and other material support for hospitals, medical services for countries outside the united states.', 'Yes'),
(419, 'Q', '4', '', 'International peace & security', 'Organizations that promote harmony and understanding among nations either globally or in a particular region of the world and/or engage in activities that promote peaceful ways of managing and settling international conflicts. use this code for organizations that promote international peace in a general way or which have specific programs devoted to international peace and security other than those specified below.', 'Yes'),
(420, 'Q', '4', '1', 'Arms control & peace', 'Organizations that promote control of nuclear, biological, chemical and conventional weapons development and proliferation.', 'Yes'),
(421, 'Q', '4', '2', 'United nations associations', 'Organizations whose activities relate specifically to the united nations.', 'Yes'),
(422, 'Q', '4', '3', 'National security', 'Organizations that conduct studies on major national security topics including the u.s. armed forces, weapons decisions, deployment policies and the security aspects of u.s. foreign relations; monitor legislation on national security issues; advocate for specific defense policies and expenditures; and engage in other activities related to the security of the united states.', 'Yes'),
(423, 'Q', '5', '', 'International affairs, foreign policy, & globaliza', 'Organizations that conduct studies on foreign policy, national security, regional affairs and international energy, economic, and trade policies; monitor foreign policy legislation; hold conferences seminars and debates to expand interest in international issues and promote understanding of us foreign policy and international affairs; address problems of globalization; publish journals, newsletters, and other materials addressing foreign policy issues; and engage in other activities relating to foreign policy.', 'Yes'),
(424, 'Q', '5', '1', 'International economic & trade policy', 'Organizations whose primary purpose is promote world trade and strengthen international trade and investment position of the us, states and localities. services may include analyses of the competitiveness of specific industries, development of trade policies, negotiating market access for us companies and promoting exports through trade missions, shows, and fairs in major overseas markets.', 'Yes'),
(425, 'Q', '7', '', 'International human rights', 'Organizations that work to protect individuals around the world from denial of civil rights and liberties or other arbitrary governmental interference, harassment, or abuse due to their political or religious beliefs.', 'Yes'),
(426, 'Q', '7', '1', 'International migration & refugee issues', 'Organizations that monitor and inform the public about the world refugee situation; review refugee-related legislation; and advocate for specific policies relating to the plight of refugees in other countries. also included are organizations that raise money to enable refugees to leave their own countries and migrate to foreign countries of their choice; or provide aid to refugees who have left their country of origin and are residing in another country outside the united states.', 'Yes'),
(427, 'Q', '9', '9', 'International, foreign affairs & national security', 'Use this code for organizations that clearly provide services related to international affairs where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(428, 'R', '0', '', 'Support services for civil rights, social action &', '', 'Yes'),
(429, 'R', '1', '', 'Fund raising & fund distribution and financial ser', 'Organizations existing as a fund-raising entity for a single institution within the civil rights, social action & advocacy major group area.', 'Yes'),
(430, 'R', '1', '9', 'General support services for international, civil ', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations in the civil rights, social action, advocacy major group area.', 'Yes'),
(431, 'R', '2', '', 'Civil rights', 'Organizations that work for the passage and enforcement of laws or other social measures that will more effectively protect the rights of specific groups. use this code for organizations that broadly address civil rights and advocacy issues or which focus on populations not specified below.', 'Yes'),
(432, 'R', '2', '1', 'Immigrants\' rights<i>(draft code - not for interna', 'Organizations that support the passage and enforcement of laws and other social measures which protect the rights and interests of individuals who have newly arrived in the country or which govern the process by which individuals and families are granted permission to immigrate.', 'Yes'),
(433, 'R', '2', '2', 'Minority rights', 'Organizations that support the passage and enforcement of laws and other social measures that protect and promote the rights and interests of one or more specific ethnic groups or individuals who have a common national origin. use this code for organizations like the naacp and la raza.', 'Yes'),
(434, 'R', '2', '3', 'Disabled persons rights', 'Organizations that support the passage and enforcement of laws or other social measures that protect the rights of people who have disabilities and maximize their ability to enjoy the same opportunities, resources and privileges as the mainstream population.', 'Yes'),
(435, 'R', '2', '4', 'Womens rights', 'Organizations that support the passage and enforcement of laws and other social measures that protect and promote the rights and interests of women.', 'Yes'),
(436, 'R', '2', '5', 'Seniors rights', 'Organizations that support the passage and enforcement of laws and other social measures that protect and promote the rights of older adults.', 'Yes'),
(437, 'R', '2', '6', 'Lesbian & gay rights', 'Organizations that support the passage and enforcement of laws and other social measures that protect and promote the rights and interests of individuals who are gay, lesbian, bisexual, or transgender.', 'Yes'),
(438, 'R', '2', '7', 'Patients\' rights<i>(draft code - not for internal ', 'Organizations that support the passage and enforcement of laws and other social measures that protect and promote the rights and interests of patients.', 'Yes'),
(439, 'R', '2', '8', 'Children\'s rights', 'Organizations that support the passage and enforcement of laws and other social measures that protect and promote the rights and interests of children and youth.', 'Yes'),
(440, 'R', '2', '9', 'Employee & workers\' rights<i>(draft code - not for', 'Organizations that support the passage and enforcement of laws and other social measures that protect and promote the rights of groups of workers and employees.', 'Yes'),
(441, 'R', '3', '', 'Intergroup & race relations', 'Organizations that work for increased harmony and understanding among diverse groups in the community and to reduce or eliminate tensions and violence based on age, gender, race, color, sexual preference, creed, national origin, income level or stereotypical identification.', 'Yes'),
(442, 'R', '4', '', 'Voter education & registration', 'Organizations that encourage citizens to participate in the political process, in a nonpartisan manner, by providing opportunities for political involvement, access to public officials, information that is necessary to make informed decisions at the ballot box or assistance in registering to vote.', 'Yes'),
(443, 'R', '6', '', 'Civil liberties', 'Organizations that protect the rights of people guaranteed by the constitution and promote the passage of laws or other social measures that extend individual rights or more effectively protect them. use this code for organizations that advocate for a wide variety of civil liberties or for specific rights that are not specified below.', 'Yes'),
(444, 'R', '6', '1', 'Reproductive rights', 'Organizations that support the passage and enforcement of laws and other social measures which preserve a womans right to terminate her pregnancy.', 'Yes'),
(445, 'R', '6', '2', 'Right to life', 'Organizations that support the passage of legislation which assigns legal rights to the unborn and seeks to criminalize the termination of unwanted pregnancies.', 'Yes'),
(446, 'R', '6', '3', 'Censorship, freedom of speech & press', 'Organizations that support the right of the press to freedom of expression without censorship or other restrictions by government and/or which support the right of the media to maintain confidential sources.', 'Yes'),
(447, 'R', '6', '5', 'Freedom of religion issues<i>(draft code - not for', 'Organizations that support the passage of legislation and other social measures that protect or extend the rights of individuals to conduct their lives according to the precepts of their faith.', 'Yes'),
(448, 'R', '6', '7', 'Right to die & euthanasia', 'Organizations that support the right of people who may be terminally ill to end their own lives in a planned manner either by active means or by the removal of life-support systems.', 'Yes'),
(449, 'R', '9', '9', 'Civil rights, social action & advocacy n.e.c.', 'Use this code for organizations that clearly provide civil rights, social action or advocacy services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(450, 'S', '', '', 'Community improvement & capacity building', 'Na', 'Yes'),
(451, 'S', '0', '', 'Support services for community improvement & capac', '', 'Yes'),
(452, 'S', '1', '', 'Fund raising & fund distribution and community imp', 'Organizations existing as a fund-raising entity for a single institution within the community improvement & capacity building major group area.', 'Yes'),
(453, 'S', '1', '9', 'General support services for community improvement', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the community improvement, capacity building major group area.', 'Yes'),
(454, 'S', '2', '', 'Community & neighborhood development', 'Organizations that focus broadly on strengthening, unifying and building the economic, cultural, educational and social services of an urban community or neighborhood. use this code for community and neighborhood improvement organizations other than those specified below.', 'Yes'),
(455, 'S', '2', '1', 'Community coalitions', 'Organizations that are designed to increase citizen participation in local policy issues and thereby improve the overall quality of life in a particular state or community.', 'Yes'),
(456, 'S', '2', '2', 'Neighborhood & block associations', 'Organizations whose members are residents of a particular community or neighborhood who have joined together to remedy deficiencies in existing neighborhood conditions or to enhance conditions that are currently satisfactory.', 'Yes'),
(457, 'S', '3', '', 'Economic development', 'Organizations whose primary purpose is to stimulate the economy, expand employment opportunities, encourage the establishment and growth of commerce and industry and otherwise enhance the economic development of the community.', 'Yes'),
(458, 'S', '3', '1', 'Urban & community economic development', 'Organizations that provide technical assistance, loans, loan guarantees or other forms of management support to help impoverished urban communities create local jobs, sustain local services and build healthier local economies.', 'Yes'),
(459, 'S', '3', '2', 'Rural economic development', 'Organizations that provide technical assistance, venture capital, loans, loan guarantees or other forms of management support to encourage the establishment and growth of business and industry in rural areas.', 'Yes'),
(460, 'S', '4', '', 'Business & industry', 'Organizations that provide technical assistance, loans, loan guarantees and other forms of assistance to support the development and growth of a wide variety of business establishments in the community.', 'Yes'),
(461, 'S', '4', '1', 'Chambers of commerce & business leagues', 'Organizations like chambers of commerce, business leagues and commercial trade associations whose members are businessmen and women and merchants who have affiliated for the purpose of promoting the general commercial interests of the community or the interests of their own trade. \\[many of these are found in section 501(c)(6) business leagues; and 501(c)(6) chambers of commerce.\\]', 'Yes'),
(462, 'S', '4', '3', 'Small business development', 'Organizations that provide technical assistance, venture capital, loans, loan guarantees or other forms of support for individuals or groups who want to establish or expand the operation of a small business enterprise or venture.', 'Yes'),
(463, 'S', '4', '6', 'Boards of trade', '501(c)(6) organizations that are involved in regulating, promoting or conducting commodities and commercial investment exchanges.', 'Yes'),
(464, 'S', '4', '7', 'Real estate associations', 'Organizations whose members are in the real estate business who have affiliated for the purpose of promoting the interests of their trade.', 'Yes'),
(465, 'S', '5', '', 'Nonprofit management', 'Organizations that provide technical assistance for nonprofit organizations who need management support in areas like board development; facility administration; fiscal administration; grant writing; personnel administration; program planning, development or evaluation; service delivery; volunteer utilization; or public relations. use this code for nonprofit management support centers.', 'Yes'),
(466, 'S', '8', '', 'Community service clubs', 'Organizations whose members are business and professional men and/or women or other individuals who have a common interest in improving the life of the community, which conduct fund-raising events to finance community service projects. many service clubs are chapters of national or international organizations.', 'Yes'),
(467, 'S', '8', '1', 'Womens service clubs', 'Organizations whose members are women who have a common interest in improving the life of the community, which conduct fund-raising events to finance community service projects.', 'Yes'),
(468, 'S', '8', '2', 'Mens service clubs', 'Organizations whose members are men who have a common interest in improving the life of the community, which conduct fund-raising events to finance community service projects.', 'Yes'),
(469, 'S', '9', '9', 'Community improvement & capacity building n.e.c.', 'Use this code for organizations that clearly provide community improvement, capacity building services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(470, 'T', '', '', 'Philanthropy, voluntarism & grantmaking foundation', 'Na', 'Yes'),
(471, 'T', '0', '', 'Support services for philanthropy, voluntarism & g', '', 'Yes'),
(472, 'T', '1', '', 'Fund raising & fund distribution and philanthropy,', 'Organizations existing as a fund-raising entity for a single institution within the philanthropy, voluntarism & grantmaking foundations major group area.', 'Yes'),
(473, 'T', '1', '9', 'General support services for philanthropy, volunta', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the philanthropy, voluntarism, and grantmaking foundations major group area.', 'Yes'),
(474, 'T', '2', '', 'Private grantmaking foundations', 'Nongovernmental, nonprofit organizations with funds (usually from a single source, such as an individual, family or corporation) and programs managed by its own trustees or directors, established to maintain or aid social, educational, religious or other charitable activities serving the common welfare, primarily through grantmaking. t20 should be used only if one of the more specific codes in the t20 series cannot be determined.', 'Yes'),
(475, 'T', '2', '1', 'Corporate foundations', 'Private foundations whose grant funds are derived primarily from the contributions of a profit-making business organization.', 'Yes'),
(476, 'T', '2', '2', 'Private independent foundations', 'Private foundations that make grants based on charitable endowments. because of their endowments, they are focused primarily on grantmaking and generally do not actively raise funds or seek public financial support. these are the most common type of private foundation. they are generally endowed, usually from a single individual or family. private foundations are considered family foundations if relatives or the original donor are still active on the board of trustees or in the operation of the foundation.', 'Yes'),
(477, 'T', '2', '3', 'Private operating foundations', 'Private foundations that use a bulk of their resources to provide charitable services or run charitable programs of their own. they make few, if any, grants to outside organizations and, like private independent foundations, they generally do not raise funds from the public.', 'Yes'),
(478, 'T', '3', '', 'Public foundations', 'Organizations, sometimes referred to as public charities, that derive their funding or support primarily from the general public in carrying out their social, educational, religious or other charitable activities serving the common welfare. although public foundations may provide direct charitable services to the public as other nonprofits do, their primary focus is on grantmaking.', 'Yes'),
(479, 'T', '3', '1', 'Community foundations', 'Organizations that make grants for charitable purposes in a specific community or region. the funds available to a community foundation are usually derived from many donors and held in an endowment that is independently administered; income earned by the endowment is then used to make grants. (rev. 11/04)', 'Yes'),
(480, 'T', '4', '', 'Voluntarism promotion', 'Organizations that encourage people to volunteer. (rev. 1/05)', 'Yes'),
(481, 'T', '5', '', 'Philanthropy, charity & voluntarism promotion', 'Organizations concerned with civil society, philanthropy, and the nonprofit sector who seek to promote the practice of charitable giving and voluntarism through a variety of strategies including advocacy, disclosure, information exchange, and research. (rev. 1/05)', 'Yes'),
(482, 'T', '7', '', 'Federated giving programs', 'Organizations that administer centralized fundraising efforts and then in turn distribute the contributed funds to several nonprofit agencies. united way and community chests or funds, the united jewish appeal and other religious appeals are examples of federated giving programs. (rev. 1/05)', 'Yes'),
(483, 'T', '9', '', 'Named trusts n.e.c.', 'Use this code for named trusts not classified elsewhere. (rev. 11/04)', 'Yes'),
(484, 'T', '9', '9', 'Philanthropy, voluntarism & grantmaking foundation', 'Use this code for organizations that clearly provide philanthropy, voluntarism and grantmaking services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(485, 'U', '', '', 'Science & technology', 'Na', 'Yes'),
(486, 'U', '0', '', 'Support services for science & technology related ', '', 'Yes'),
(487, 'U', '1', '1', 'Fund raising & fund distribution for science and t', 'Organizations existing as a fund-raising entity for a single institution within the science & technology major group area.', 'Yes'),
(488, 'U', '1', '9', 'General support services for science & technology ', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the science and technology research institutes, services major group area.', 'Yes'),
(489, 'U', '2', '', 'General science', 'Organizations that focus broadly on scientific research and inquiry or which engage in interdisciplinary science activities.', 'Yes'),
(490, 'U', '2', '1', 'Marine science & oceanography', 'Organizations that support or conduct research in the area of science that studies the oceans and associated phenomena including the land/ water and water/atmospheric boundaries.', 'Yes'),
(491, 'U', '3', '', 'Physical & earth sciences', 'Organizations that conduct research in the physical and earth sciences, i.e., the area of science that studies inanimate objects, processes of matter and energy and associated phenomena. use this code for organizations that conduct research that broadly covers the physical and earth sciences or for those that address areas of scientific study not specified below.', 'Yes'),
(492, 'U', '3', '1', 'Astronomy', 'Organizations that conduct research in astronomy, the physical science that addresses matter and energy in the universe using observational techniques such as spectroscopy, photometry, interferometry, radio astronomy and optical astronomy.', 'Yes'),
(493, 'U', '3', '3', 'Chemistry & chemical engineering', 'Organizations that conduct research in chemistry, the science which addresses the composition and behavior of matter including its micro- and macro-structure, the processes of chemical change and the theoretical description and laboratory simulation of these phenomena.', 'Yes'),
(494, 'U', '3', '4', 'Mathematics', 'Organizations that conduct research in mathematics, the science which addresses quantities, magnitudes, forms and their relationships using symbolic logic and language.', 'Yes'),
(495, 'U', '3', '6', 'Geology', 'Organizations that conduct research in the area of science that studies the earth; the forces acting upon it; and the behavior of the solids, liquids and gases comprising it.', 'Yes'),
(496, 'U', '4', '', 'Engineering & technology', 'Organizations that conduct research in the area of science which applies mathematical and scientific principles to the solution of practical problems for the benefit of society.', 'Yes'),
(497, 'U', '4', '1', 'Computer science', 'Organizations that conduct research in the area of science that addresses the study of data and information storage and processing systems including hardware, software, basic design principles, user requirements analysis and related economic and policy issues.', 'Yes'),
(498, 'U', '4', '2', 'Engineering', 'Organizations that conduct research in the field of engineering in which mathematical and scientific principles are applied to solve a wide variety of practical problems in industry, social organization, public works and commerce.', 'Yes'),
(499, 'U', '5', '', 'Biological & life sciences', 'Organizations that conduct research in the sciences which analyze the structure, function, growth, origin, evolution or distribution of living organisms and their relations to their natural environments.', 'Yes'),
(500, 'U', '9', '9', 'Science & technology n.e.c.', 'Use this code for organizations that clearly provide science and technology research services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(501, 'V', '', '', 'Social science', 'Na', 'Yes'),
(502, 'V', '0', '', 'Support services for social science related servic', '', 'Yes'),
(503, 'V', '1', '', 'Fund raising & fund distribution for social scienc', 'Organizations existing as a fund-raising entity for a single institution within the social science major group area.', 'Yes'),
(504, 'V', '1', '9', 'General support services for social science relate', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the social science research institutes, services major group area.', 'Yes'),
(505, 'V', '2', '', 'Social science', 'Organizations that conduct research, study or teaching in one or more of the social sciences, i.e., those involving the systematic study of social systems, social institutions and social behavior.', 'Yes'),
(506, 'V', '2', '1', 'Anthropology & sociology', 'Organizations that conduct research in the area of social science that involves the systematic study of human beings, their antecedents and related primates, and their cultural behavior and institutions in comparative perspective (anthropology); and/or the study of social institutions and social relationships (sociology).', 'Yes'),
(507, 'V', '2', '2', 'Economics', 'Organizations that conduct research in the area of social science that involves the systematic study of the production, conservation and allocation of resources in conditions of scarcity, together with the organizational frameworks related to these processes.', 'Yes'),
(508, 'V', '2', '3', 'Behavioral science', 'Organizations that conduct research in psychology, the social science that involves the systematic study of individual and collective behavior, the physical and environmental bases of behavior, and the analysis and treatment of behavior problems and disorders.', 'Yes'),
(509, 'V', '2', '4', 'Political science', 'Organizations that conduct research in the area of social science that involves the systematic study of political institutions and behavior.', 'Yes'),
(510, 'V', '2', '5', 'Population studies', 'Organizations that conduct research in the area of social science that involves the systematic study of population models and population phenomena, and related problems of social structure and behavior.', 'Yes'),
(511, 'V', '2', '6', 'Law & jurisprudence', 'Organizations that conduct research in the area of social science that involves the systematic study of the theory, history and application of the rules of conduct by which societal relations are formally structured and adjudicated.', 'Yes'),
(512, 'V', '3', '', 'Interdisciplinary research', 'Organizations that bring together the humanities, physical sciences and social sciences to develop and enhance a broad understanding of particular populations, cultures or other related areas of research. use this code for organizations that conduct broadly conceived interdisciplinary research or for those that address areas of interdisciplinary study not specified below.', 'Yes'),
(513, 'V', '3', '1', 'Black studies', 'Organizations that conduct research in the area of social science that involves the systematic study of the history, society, politics, culture and economics of the african american populations of the western hemisphere, with emphasis on the united states and the caribbean.', 'Yes'),
(514, 'V', '3', '2', 'Womens studies', 'Organizations that conduct research in the area of social science that involves the systematic study of the history, society, politics, culture and economics of women as individuals and social actors.', 'Yes'),
(515, 'V', '3', '3', 'Ethnic studies', 'Organizations that conduct research in the area of social science that involves the systematic study of the history, society, politics, culture and economics of subsets of the population sharing common racial characteristics or common traits and customs.', 'Yes'),
(516, 'V', '3', '4', 'Urban studies', 'Organizations that conduct research in the area of social science that applies social science principles to the study of urban institutions and the forces influencing urban social and political life.', 'Yes'),
(517, 'V', '3', '5', 'International studies', 'Organizations that conduct research in the area of social science that involves the systematic study of the history, society, politics, culture and economics of particular geographical areas throughout the world.', 'Yes'),
(518, 'V', '3', '6', 'Gerontology', 'Organizations that conduct research in the area of social science that involves the systematic study of the human aging process and aged human populations using the knowledge and methodologies of the social sciences, psychology and the biological health sciences.', 'Yes'),
(519, 'V', '3', '7', 'Labor studies', 'Organizations that conduct research in the area of social science that involves the systematic study of employee-management interactions and the management of issues and disputes regarding working conditions and worker benefit packages.', 'Yes'),
(520, 'V', '9', '9', 'Social science n.e.c.', 'Use this code for organizations that clearly provide social science research services where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(521, 'W', '', '', 'Public & societal benefit', 'Na', 'Yes'),
(522, 'W', '0', '', 'Support services for public and societal related s', '', 'Yes'),
(523, 'W', '1', '', 'Fund raising & fund distribution for public and so', 'Organizations existing as a fund-raising entity for a single institution within the public & societal benefit major group area.', 'Yes'),
(524, 'W', '1', '9', 'General support services for public and societal r', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the public, society benefit - multipurpose and other major group area.', 'Yes'),
(525, 'W', '2', '', 'Government & public administration', 'Organizations that are concerned with the effective functioning of government including the administration of public agencies and the actions and decisions of public officials. use this code for organizations that undertake a broad range of activities directed at improving the functioning of the public sector and for those that provide specific services in this area that are not specified below.', 'Yes'),
(526, 'W', '2', '2', 'Public finance, taxation & monetary policy', 'Organizations that are primarily engaged in financial administration and taxation including monetary policy; tax administration; collection, custody and disbursement of funds; debt and investment administration; and other similar activities.', 'Yes'),
(527, 'W', '2', '4', 'Citizen participation', 'Organizations that seek to ensure the broad participation of community residents in government decision making and the political process.', 'Yes'),
(528, 'W', '3', '', 'Military & veterans organizations', 'Membership organizations that are engaged in promoting the interests of the veterans or active or retired military personnel who are their members.', 'Yes'),
(529, 'W', '4', '', 'Public transportation systems', 'Organizations that provide fixed-route mass transit services that utilize buses, trains, ferry boats or other vehicles to transport people within the limits of a city, a metropolitan area, a county or a multi-county region, or to move people from outlying areas into a city or metropolitan area.', 'Yes'),
(530, 'W', '5', '', 'Telecommunications', 'Organizations that furnish point-to-point communications services including telephone and telegraph services.', 'Yes'),
(531, 'W', '6', '', 'Financial institutions', 'Organizations that provide an alternative to the traditional banking system for people who want to maintain checking or savings accounts, purchase money orders, cash third-party checks or engage in other financial transactions.', 'Yes'),
(532, 'W', '6', '1', 'Credit unions', 'Cooperative 501(c)(14) associations that use money deposited by a group of people (e.g., fellow employees) and lend it out again to people in the same group at favorable interest rates.', 'Yes'),
(533, 'W', '7', '', 'Leadership development', 'Organizations that are designed to train people to become effective leaders at the national or local level.', 'Yes'),
(534, 'W', '8', '', 'Public utilities', 'Organizations that provide gas, electricity, water and sanitary services including the hook-up of services and the installation, maintenance and repair of necessary equipment. \\[many are located in section 501(c)(12).\\]', 'Yes'),
(535, 'W', '9', '', 'Consumer protection', 'Organizations that provide for the education and protection of individuals who purchase, use, maintain and dispose of products and services.', 'Yes'),
(536, 'W', '9', '9', 'Public & societal benefit n.e.c.', 'Use this code for organizations that clearly provide services relating to public affairs or society benefit where the major purpose is unclear enough that a more specific code cannot be accurately assigned.', 'Yes'),
(537, 'X', '', '', 'Religion-related', 'Na', 'Yes'),
(538, 'X', '0', '', 'Support services for religion related services and', '', 'Yes'),
(539, 'X', '1', '', 'Fund raising & fund distribution for religion rela', 'Organizations existing as a fund-raising entity for a single institution within the religion-related major group area.', 'Yes'),
(540, 'X', '1', '9', 'General support services for religion related rela', 'Organizations that provide all forms of support except for financial assistance or fund raising for other organizations within the religion related, spiritual development major group area.', 'Yes'),
(541, 'X', '2', '', 'Christianity', 'Religious organizations that provide opportunities for people to satisfy their inner needs and enhance their spiritual growth through organized worship or through other devotional activities under the auspices of one of the group of religious faiths that is based on the teachings of jesus christ. use this code for christian denominations that are not specified below as well as their ministries, missions or missionary activities; bible camps and schools. (rev. 11/04)', 'Yes'),
(542, 'X', '2', '1', 'Protestant', 'Religious organizations whose form of christian faith and practice originated with the principles of the reformation. use this code for protestant churches as well as their ministries, missions or missionary activities; bible camps and schools; and bible distribution programs.', 'Yes'),
(543, 'X', '2', '2', 'Roman catholic', 'Religious organizations characterized by their acknowledgement of the supreme authority of the bishop of rome, the pope, in matters of faith. use this code for roman catholic churches as well as their ministries, missions or missionary activities; bible camps and schools; and bible distribution programs.', 'Yes'),
(544, 'X', '3', '', 'Judaism', 'Organizations whose members are a worldwide group which constitutes a continuation through descent or conversion of the ancient jewish people; who practice judaism, a religion that is characterized by a belief in one god and in the mission of jews to teach the oneness of god as revealed in the hebrew scriptures. organizations making reference to lubavitch, chabad, yeshiva, and torah should also be classified here, but not necessarily those mentioning israel, hebrew, and shalom.', 'Yes'),
(545, 'X', '4', '', 'Islam', 'Organizations whose members are followers of islam, the religious faith and cultural system that is based on the belief in allah as the sole deity, in mohammed as the prophet of allah and in the koran as the revelation of allah to mohammed and the divinely authorized basis for the religious, social, civil, commercial, military and legal regulations of the islamic world.', 'Yes'),
(546, 'X', '5', '', 'Buddhism', 'Organizations whose members are followers of the religion of eastern and central asia that is based on the teachings of gautama buddha which stress that suffering is inherent in life and that one can achieve nirvana (release from suffering) through mental and moral self-purification. includes zen.', 'Yes'),
(547, 'X', '7', '', 'Hinduism', 'Organizations whose members are followers of the religious philosophy that originated on the indian subcontinent and is marked by an outlook that tends to view all forms and theories as aspects of one eternal being and truth; a belief in ahimsa, karma, dharma, samsara and moksha; and the practice of the way of works, the way of knowledge or the way of devotion as the means of release from the round of rebirths.', 'Yes'),
(548, 'X', '8', '', 'Religious media & communications', 'Organizations with religious affiliations that are engaged in publishing, production or programming that has religious content. use this code for organizations utilizing multiple types of media or for media not specified below.', 'Yes'),
(549, 'X', '8', '1', 'Religious film & video', 'Organizations with religious affiliations that produce films, videos and holographic images which have religious content.', 'Yes'),
(550, 'X', '8', '2', 'Religious television', 'Organizations with religious affiliations that are engaged in television productions and broadcasts which have religious content.', 'Yes'),
(551, 'X', '8', '3', 'Religious printing & publishing', 'Organizations with religious affiliations that publish books such as bibles and other materials which have religious content.', 'Yes'),
(552, 'X', '8', '4', 'Religious radio', 'Organizations with religious affiliations that are engaged in radio productions and broadcasts which have religious content.', 'Yes'),
(553, 'X', '9', '', 'Interfaith coalitions', 'Organizations representing multiple faiths that have gathered together to establish a worldwide christian (or other religious) unity; to promote cooperation on such common tasks as supporting missions, working with students and sponsoring conferences; to establish mutual understanding regarding the fundamental issues of belief, worship and polity; and to serve as a united witness on world problems.', 'Yes'),
(554, 'X', '9', '9', 'Religion-related n.e.c.', 'Use this code for organizations that clearly provide services relating to religion where a more specific code cannot be accurately assigned. examples may include unitarianism, taoism, sikhs, zoroastrism, atheism, actualism, theosophy, bahaism and reference to miracles.', 'Yes');
